INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.lustig.slots', 'ANDROID', '2017-11-30 03:05:08.406243', 'Казино Клуб Red Edition', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.lustig.slots', 'https://lh3.googleusercontent.com/e0Fq-7qen7KWusNHLlFFd8nMDGQQh-ixhDKIoj6KEbyxJ4F2quXhlRQHrkwb4yAe-Gk', '2017-12-12 16:30:47.641695','' , '{''size'': None, ''reviews_text'': '''', ''url'': ''https://play.google.com/store/apps/details?id=com.lustig.slots'', ''category'': [''GAME_CASINO''], ''required_android_version'': ''4.1 или более поздняя'', ''price'': ''0'', ''video'': None, ''score'': None, ''icon'': ''https://lh3.googleusercontent.com/e0Fq-7qen7KWusNHLlFFd8nMDGQQh-ixhDKIoj6KEbyxJ4F2quXhlRQHrkwb4yAe-Gk'', ''description_html'': ''Казино Вулкан Клуб!<br/><br/>-----<br/><br/>Казино Вулкан Клуб приветствует самых азартных и не представляющих свою жизнь без адреналина людей!<br/><br/>😍 😍 😍<br/><br/>Мы создали лучшее приложение для тех, кто любит игровые автоматы, объединив классические слоты, современную, графику, доступность 24 часа в сутки. И все это бесплатно в Вулкан Клуб!<br/><br/>Все, что может предложить классическое казино ты сможешь найти в своем телефоне – игровые автоматы онлайн, рулетка, потрясающие турниры, розыгрыши и конечно же, джекпот.<br/><br/>Наши слоты понравятся всем:<br/>🍓 Клубнички<br/>🐵 Обезьянки<br/>7️⃣ Семерки<br/>И другие однорукие бандиты из лучших казино.<br/><br/>Что нужно чтобы играть в самые топовые слоты?<br/><br/>Казино Вулкан Клуб – это новое мобильное приложение, которое доступно онлайн после скачивания на любом телефоне.<br/><br/>Качай игровые автоматы бесплатно, крути барабан, получай фриспины – и все, ты вступил в клуб любителей лучших азартных игр, пусть вулкан страстей закипит в твоей душе!<br/><br/>Игровые автоматы предназначены для совершеннолетних. Выигрыш в слоты является виртуальной имитацией и не гарантирует успех в реальных ставках.'', ''developer_address'': None, ''recent_changes'': ''first release'', ''developer'': ''Singapore games'', ''developer_url'': None, ''title'': ''Казино Клуб Red Edition'', ''interactive_elements'': [], ''free'': True, ''description'': ''Казино Вулкан Клуб!\n-----\nКазино Вулкан Клуб приветствует самых азартных и не представляющих свою жизнь без адреналина людей!\n😍 😍 😍\nМы создали лучшее приложение для тех, кто любит игровые автоматы, объединив классические слоты, современную, графику, доступность 24 часа в сутки. И все это бесплатно в Вулкан Клуб!\nВсе, что может предложить классическое казино ты сможешь найти в своем телефоне – игровые автоматы онлайн, рулетка, потрясающие турниры, розыгрыши и конечно же, джекпот.\nНаши слоты понравятся всем:\n🍓 Клубнички\n🐵 Обезьянки\n7️⃣ Семерки\nИ другие однорукие бандиты из лучших казино.\nЧто нужно чтобы играть в самые топовые слоты?\nКазино Вулкан Клуб – это новое мобильное приложение, которое доступно онлайн после скачивания на любом телефоне.\nКачай игровые автоматы бесплатно, крути барабан, получай фриспины – и все, ты вступил в клуб любителей лучших азартных игр, пусть вулкан страстей закипит в твоей душе!\nИгровые автоматы предназначены для совершеннолетних. Выигрыш в слоты является виртуальной имитацией и не гарантирует успех в реальных ставках.'', ''thumbnails'': [''https://lh3.googleusercontent.com/oUTEv2w07d3gdwmU-az3IgAWJBCHgxTd842lSFnBx7HOCYH84I34BQ5cEg9mha5Ec9k=h310'', ''https://lh3.googleusercontent.com/rZoRqBZo2ZkK9ijDBGDAvctBRuuXAEpMVses6P4bDCup0Vi4NXmb1vPEtTf9ECF7bmG6=h310'', ''https://lh3.googleusercontent.com/vtORSfmVVz7-cQq5S_9sFdcswxBWponh4Xhlv2r_peSM2wusIQSKvYjAVRdyTGBN_aje=h310'', ''https://lh3.googleusercontent.com/LflS11eojR6RazdX-JcGdfd2uvCP61LUlVR8t0WpR7GyTr2UfGkUdyocNn2KVdvQ9ZI=h310''], ''iap'': False, ''updated'': ''25 ноября 2017 г.'', ''reviews'': 0, ''developer_email'': ''Woltzmrk1@gmail.com'', ''screenshots'': [''https://lh3.googleusercontent.com/oUTEv2w07d3gdwmU-az3IgAWJBCHgxTd8