INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.mkiisoft.webviewtest11', 'ANDROID', '2017-12-02 03:01:46.000348', 'Клуб игровые автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.mkiisoft.webviewtest11', 'https://lh3.googleusercontent.com/g9guPEf9p2FVn1EgU__QnxEjkjz0o7teQpMxFia2PN19t_p-AOBBDGgzE3XFQ07G2R4', '2017-12-20 02:30:28.549290','' , '{''description'': ''Не знаете, куда спрятаться от повседневной суеты и серости? Хотите отдохнуть после работы или учебы? Устали от однообразия и рутины? Тогда наше казино вулкан – именно то, что вам нужно. С нами вы гарантированно отдохнете и отвлечетесь. Здесь возможно все: игра в игровые автоматы онлайн, популярные и новейшие игровые автоматы, поднятие джек-пота. У нас вы гарантированно найдете не только популярные слоты удача, но и более новые и не менее увлекательные. С нами легко выигрывать, получать удовольствие от каждого  момента, проведенного в казино удача. Установка приложения позволит вам окунуться в мир развлечений, почувствовать вкус свободы и победы. С нами вы сможете играть везде и всегда. Единственное, что вам потребуется для игры в вулкан клуб – минимальное соединение с сервером через интернет для подсчета джек-пота. С нами игровые слоты онлайн не ограничатся несколькими линиями. Вы сможете выбрать более 20 линий. Превосходная бонусная программа позволяет играть и выигрывать легко. Благодаря нашим симуляторам игровых автоматов, виртуальное казино стало очень популярным.'', ''required_android_version'': ''4.1 или более поздняя'', ''app_id'': ''com.mkiisoft.webviewtest11'', ''developer_address'': None, ''icon'': ''https://lh3.googleusercontent.com/g9guPEf9p2FVn1EgU__QnxEjkjz0o7teQpMxFia2PN19t_p-AOBBDGgzE3XFQ07G2R4'', ''developer_url'': None, ''recent_changes'': '''', ''free'': True, ''editors_choice'': False, ''top_developer'': False, ''content_rating'': ''12+'', ''interactive_elements'': [], ''ca