у.\nВулкан игровые автоматы – настоящий прорыв в мире досуговых приложений. Вас обязательно порадует красочный интерфейс, яркая графика и стильное внешнее оформление. Каждое Ваше действие найдет моментальный отклик и будет сопровождаться забавными спецэффектами. Что требуется от Вас? Совсем немного: стабильное интернет-соединение и немного свободной памяти Вашего гаджета. Независимо от модели Вашего девайса и его возможностей, вулкан автоматы будут стабильно работать и качественно отображаться.\nХватит скучать и однообразно проводить досуг, присоединяйтесь к нам и начинайте развлекаться в абсолютно новом формате.'', ''screenshots'': [''https://lh3.googleusercontent.com/xhD5J1W5V_2lGqFUkUqiKrHcSZElBlNhdf-ejt7slYe1xt9vXj4aqfD3F0fVhApxhp8=h900'', ''https://lh3.googleusercontent.com/FRVltdykhD8LYJ5I_fGaxstxDkUCXiSTQZ2aHDkgfDbxqFYwCUOxdBik1Cpt9I5EuY2d=h900'', ''https://lh3.googleusercontent.com/f_4LG-PKAI3hzGM0u8eMyYa1yc3Xe7vXszjztj-nUJ0rS6BEY3-5d_sba3Iz60q-QSU=h900''], ''icon'': ''https://lh3.googleusercontent.com/zttHJ2i8aGff0bJLAfTUsOopgRS8-9v3n2Qa18gpvdZY4pCU07pLKFHtemZrLqva2Wc'', ''updated'': ''18 декабря 2017 г.''}');
