INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('zavoleerio.vaxerowller', 'ANDROID', '2017-12-11 03:02:02.813628', 'Клуб - Игровые автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=zavoleerio.vaxerowller', 'https://lh3.googleusercontent.com/jKkOfHU5mkji5eBfIxHlyUrL16NQ3Lhi4nAqRKfXxLJHU0zBleuXydDwrIkfMuoMrOE', '2018-01-03 17:00:29.427783','' , '{''developer_email'': ''phlkdijka@gmail.com'', ''ratings'': {1: 2, 2: 2, 3: 2, 4: 2, 5: 2}, ''developer_url'': None, ''developer_id'': None, ''developer_address'': None, ''required_android_version'': ''4.1 или более поздняя'', ''updated'': ''7 декабря 2017 г.'', ''app_id'': ''zavoleerio.vaxerowller'', ''description'': ''Мы приготовили абсолютный хит для истинных любителей мобильных развлечений. Наше новое приложение казино вулкан станет Вашим проводником в беззаботный мир красочных слотов и игровых автоматов.\nВступить в вулкан клуб может абсолютно любой пользователь. Неважно, какое у Вас устройство и сколько в нем дополнительных функций, наше приложение будет качественно функционировать на любом гаджете. Нужно лишь немного свободной памяти и интернет-подключение.\nПриложение находится в бесплатном доступе, скачать его можно уже сейчас, избегая длительных регистраций и заполнения ненужных форм.\nОцените сами наши преимущества: стильный дизайн, интересное меню, качественная графика, красивое внешнее оформление, широкий функционал и бесперебойная работа. Кроме того, вулкан игровые автоматы порадуют Вас своей плавной анимацией и очень качественным звуковым сопровождением.\nНаше приложение поможет Вам радоваться жизни каждый день, не упустите свой уникальный шанс!'', ''installs'': [1000, 5000], ''editors_choice'': False, ''size'': None, ''current_version'': ''1.0'', ''icon'': ''https://lh3.googleusercontent.com/jKkOfHU5mkji5eBfIxHlyUrL16NQ3Lhi4nAqRKfXxLJHU0zBleuXydDwrIkfMuoMrOE'', ''top_developer'': False, ''reviews_text''