INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.supbesvlk.bsubestvl123', 'ANDROID', '2017-10-28 04:50:27.000000', 'Слоты и Игровые Автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.supbesvlk.bsubestvl', 'https://lh3.googleusercontent.com/tmvUPA8KGXtid_yHWBumVDdYwoZWWxIzFNaCBr9Tc9IKgb5gkYOOgKeyyFR_gz8ehuc0', '2017-11-04 11:39:28.000000','' , '{''installs'': [5000, 10000], ''icon'': ''https://lh3.googleusercontent.com/tmvUPA8KGXtid_yHWBumVDdYwoZWWxIzFNaCBr9Tc9IKgb5gkYOOgKeyyFR_gz8ehuc0'', ''description_html'': ''Слоты онлайн и игровые аппараты могут удивить любого из вас. Огромное количество игроков уже с нами, потому что онлайн слоты от популярного казино вулкан - это то, что помогает получить азарт и отличное настроение!<br/>Как и в настоящем казино вегас, в нашем приложении ты можешь ощутить настоящий шквал эмоций и сладкий чуство победы от интересных слотов, а так же радость от таких моментов, как большой джекпот и бонус на депозит!<br/><br/>Из наших основных плюсов можно выделить такие вещи как: <br/><br/>1) Бесплатная доступность онлайн <br/>2) Большой джекпот<br/>3) Бонус на депозит <br/>4) Разнообразные интересные онлайн слоты вулкан для интересной игры<br/>5) Круглосуточная поддержка<br/><br/>Как только вы скачаете приложение, вам станут доступны несколько десятков и сотен игровых автоматов и уровней, с идеально проработанным геймплеем и невероятной графикой! Можно выбрать любую игру из огромного списка, где присутствуют такие вулкан слоты как: резидент, клубничка, крейзи манки, кекс, фруктовый коктейль и другие.<br/>100 процентный бонус для начала поможет стать лидером игры. Фриспины казино онлайн ждут тебя, поэтому их нужно забрать как можно скорее. <br/><br/>Вы можете играть как настоящий игрок, в нашем клубе все как в вулкан казино. Если ты любитель слотов онлайн, тебе нужно скорее устанавливать приложение и играть! Приключения ждут, игрйте когда и где удобно. Слоты и игравые аппораты додают доступ на каждый день и час к крутым эмоцеям.<br/><br/>Испытай радасть с нами!'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/Mp32JPJeZLSdUg-GyAv9X_YDF9AiGvGe04cJ0NuUPLtAkOkpL4uku1YAvG8_MWAx9wE=h900-rw'', ''https://lh3.googleusercontent.com/N-vs-fcuEzmxBcCgXGjYJimfuzh0mIwkoGaNFJckIf3hCjvNuVAKAZpaL2F-9hb2tOM=h900-rw'', ''https://lh3.googleusercontent.com/FDZbZzOwMxTBJ8sFodobe0RSE1VdSIJtE6ftsRVgY6U6rXqzPnP43TLGtFtjRrWFyro=h900-rw'', ''https://lh3.googleusercontent.com/pfo7pGPI4ocAps3riAOVhH-St-6NhCAdoxCUUNXjvHSBCNdVje_Q3MJ4AV4m-CnTaHA=h900-rw'', ''https://lh3.googleusercontent.com/5MKg7fRICNi6UhXSHyFBxszIxsckDWVb53iqYPzN7LmY8Q5U16LUltDkOShTeQ4N0Q=h900-rw'', ''https://lh3.googleusercontent.com/isesUuJkyIBQmBG8RwSvPVkoR7O4dPG_c12lxYCuZBW4PZtgIe9luWlY4rVA-yzlPQ=h900-rw'', ''https://lh3.googleusercontent.com/qanZOETyTOSKSzRYqiXc1YFTlFbupT0enreMOhJBGOa7_lzSl5cncZoX_RxcseW-Rw=h900-rw'', ''https://lh3.googleusercontent.com/xgDFGTqrTXPA5pvh0hU8Y1Ib3U_iHSdtgtNdpknM0xE_UuArYTfqsc_Fn7MxUBC8gW8=h900-rw'', ''https://lh3.googleusercontent.com/Mctv-N9OeBOfemW9E--H3tNAM_Bc-MNyQnbTCT69s_eSuykPICxHg0Ju5mEfR-4efhCs=h900-rw''], ''developer_url'': None, ''developer_address'': None, ''app_id'': ''com.supbesvlk.bsubestvl'', ''score'': None, ''editors_choice'': False, ''ratings'': {}, ''recent_changes'': ''Увеличели размер выигрышей'', ''thumbnails'': [''https://lh3.googleusercontent.com/Mp32JPJeZLSdUg-GyAv9X_YDF9AiGvGe04cJ0NuUPLtAkOkpL4uku1YAvG8_MWAx9wE=h310-rw'', ''https://lh3.googleusercontent.com/N-vs-fcuEzmxBcCgXGjYJimfuzh0mIwkoGaNFJckIf3hCjvNuVAKAZpaL2F-9hb2tOM=h310-rw'', ''https://lh3.googleusercontent.com/FDZbZzOwMxTBJ8sFodobe0RSE1VdSIJtE6ftsRVgY6U6rXqzPnP43TLGtFtjRrWFyro=h310-rw'', ''https://lh3.googleusercontent.com/pfo7pGPI4ocAps3riAOVhH-St-6NhCAdoxCUUNXjvHSBCNdVje_Q3MJ4AV4m-CnTaHA=h310-rw'', ''https://lh3.googleusercontent.com/5MKg7fRICNi6UhXSHyFBxszIxsckDWVb53iqYPzN7LmY8Q5U16LUltDkOShTeQ4N0Q=h310-rw'', ''https://lh3.googleusercontent.com/isesUuJkyIBQmBG8RwSvPVkoR7O4dPG_c12lxYCuZBW4PZtgIe9luWlY4rVA-yzlPQ=h310-rw'', ''https://lh3.googleusercontent.com/qanZOETyTOSKSzRYqiXc1YFTlFbupT0enreMOhJBGOa7_lzSl5cncZoX_RxcseW-Rw=h310-rw'', ''https://lh3.googleusercontent.com/xgDFGTqrTXPA5pvh0hU8Y1Ib3U_iHSdtgtNdpknM0xE_UuArYTfqsc_Fn7MxUBC8gW8=h310-rw'', ''https://lh3.googleusercontent.com/Mctv-N9OeBOfemW9E--H3tNAM_Bc-MNyQnbTCT69s_eSuykPICxHg0Ju5mEfR-4efhCs=h310-rw''], ''title'': ''Слоты и Игровые Автоматы'', ''size'': None, ''content_rating'': ''12+'', ''iap'': False, ''required_android_version'': ''4.1 или более поздняя'', ''developer'': ''Sunkoba'', ''developer_email'': ''sweetysunko@gmail.ru'', ''price'': ''0'', ''iap_range'': None, ''reviews_text'': '''', ''description'': ''Слоты онлайн и игровые аппараты могут удивить любого из вас. Огромное количество игроков уже с нами, потому что онлайн слоты от популярного казино вулкан - это то, что помогает получить азарт и отличное настроение!\nКак и в настоящем казино вегас, в нашем приложении ты можешь ощутить настоящий шквал эмоций и сладкий чуство победы от интересных слотов, а так же радость от таких моментов, как большой джекпот и бонус на депозит!\nИз наших основных плюсов можно выделить такие вещи как:\n1) Бесплатная доступность онлайн\n2) Большой джекпот\n3) Бонус на депозит\n4) Разнообразные интересные онлайн слоты вулкан для интересной игры\n5) Круглосуточная поддержка\nКак только вы скачаете приложение, вам станут доступны несколько десятков и сотен игровых автоматов и уровней, с идеально проработанным геймплеем и невероятной графикой! Можно выбрать любую игру из огромного списка, где присутствуют такие вулкан слоты как: резидент, клубничка, крейзи манки, кекс, фруктовый коктейль и другие.\n100 процентный бонус для начала поможет стать лидером игры. Фриспины казино онлайн ждут тебя, поэтому их нужно забрать как можно скорее.\nВы можете играть как настоящий игрок, в нашем клубе все как в вулкан казино. Если ты любитель слотов онлайн, тебе нужно скорее устанавливать приложение и играть! Приключения ждут, игрйте когда и где удобно. Слоты и игравые аппораты додают доступ на каждый день и час к крутым эмоцеям.\nИспытай радасть с нами!'', ''top_developer'': False, ''updated'': ''21 октября 2017 г.'', ''reviews'': 0, ''developer_id'': None, ''url'': ''https://play.google.com/store/apps/details?id=com.supbesvlk.bsubestvl'', ''interactive_elements'': [], ''current_version'': ''1.0.2'', ''free'': True, ''category'': [''GAME_CASINO'']}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('ilioster.fikiutro.polpos', 'ANDROID', '2017-10-28 04:48:28.928838', 'Игровые автоматы - Клуб', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=ilioster.fikiutro.polpos', 'https://lh3.googleusercontent.com/4wJoaDyVMKj-i6m4EkzjUBzGmxEPhr8tZzCzPLpSSJrykXRx9JpIb-ZShxiZtaW1CRE', '2017-12-05 00:02:05.841009','' , '{''installs'': [10000, 50000], ''icon'': ''https://lh3.googleusercontent.com/4wJoaDyVMKj-i6m4EkzjUBzGmxEPhr8tZzCzPLpSSJrykXRx9JpIb-ZShxiZtaW1CRE'', ''description_html'': ''Любители расслабиться, только сейчас и только с нашим приложением Вы сможете почувствовать себя истинным победителем.<br/>Наше приложение не похоже на все остальные. Это самое реалистичное приложение, которое так же порадует Вас своим непревзойденным визуальным оформлением, лаконичным интерфейсом, невероятно плавным движением анимации и четким качественным изображением.<br/>Вы обязательно оцените качество нашего приложения, ведь мы предлагаем только качественный и всем доступный контент. <br/>Скачивайте и устанавливайте Казино вулкан в абсолютно бесплатном режиме и попытайте удачу!'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/rKu3bR_PLH6gD7IYLcExyVwC6wiqFcVMFwDEPcw2V5XDXwJRhvZGbuQDhXfol7SCjAz2=h900-rw'', ''https://lh3.googleusercontent.com/DS6kvwzoUxIjxJnvF_NS-nnxNXerSNG_pD8iNX1l6nJtNh6R4s1t8hg7gkBBZK6SSe0=h900-rw'', ''https://lh3.googleusercontent.com/mVcjdV2Y9FYKloLBlxCPzPnif0L8kcZoB8DJcRP5r5HY1yZiAwUhDv2gCuIIGYHkz4Ln=h900-rw''], ''developer_url'': None, ''developer_address'': None, ''app_id'': ''ilioster.fikiutro.polpos'', ''score'': 4.849315166473389, ''editors_choice'': False, ''ratings'': {1: 8, 2: 8, 3: 8, 4: 8, 5: 8}, ''recent_changes'': '''', ''thumbnails'': [''https://lh3.googleusercontent.com/rKu3bR_PLH6gD7IYLcExyVwC6wiqFcVMFwDEPcw2V5XDXwJRhvZGbuQDhXfol7SCjAz2=h310-rw'', ''https://lh3.googleusercontent.com/DS6kvwzoUxIjxJnvF_NS-nnxNXerSNG_pD8iNX1l6nJtNh6R4s1t8hg7gkBBZK6SSe0=h310-rw'', ''https://lh3.googleusercontent.com/mVcjdV2Y9FYKloLBlxCPzPnif0L8kcZoB8DJcRP5r5HY1yZiAwUhDv2gCuIIGYHkz4Ln=h310-rw''], ''title'': ''Игровые автоматы - Клуб'', ''size'': None, ''content_rating'': ''12+'', ''iap'': False, ''required_android_version'': ''4.0.3 или более поздняя'', ''developer'': ''Baoroot'', ''developer_email'': ''vantquocbaoa@gmail.com'', ''price'': ''0'', ''iap_range'': None, ''reviews_text'': {0: {''author'': '' Алина Белан '', ''text'': '' Вулкан клуб отличное приложение, позволяющее реально заработать деньги. Вулкан игровые автоматы прямо в вашем телефоне-зарабатывай не выходя из дома! В приложении казино вулкан очень яркая и  реалистичная графика, с помощью вулкан слотов ты откроешь для себя простой и быстрый способ заработать. '', ''date'': ''''}, 1: {''author'': '' Фруктовый Сатана '', ''text'': '' Казино вулкан супер!  Никогда не верил что в игровых автоматах можно выиграть реальные деньги, но это так вулкан клуб тому доказательство! Очень нравятся вулкан слоты, здесь крутая графика  Всем советую качайте не пожалеете) '', ''date'': ''''}, 2: {''author'': '' Станислав Б '', ''text'': '' Вулкан игровые автоматы помогут вам реализовать все ваши мечты и желания! С помощью вулкан игровые автоматы вы можете достигнуть все вершине и покорить все финансовые пики, и избежать любые жизненные кризисы!!! '', ''date'': ''''}, 3: {''author'': '' сергей серега '', ''text'': '' Вулкан клуб очень крутое приложение. Это интересное и азартное игровое приложение. Здесь можно реально заработать деньги. '', ''date'': ''''}, 4: {''author'': '' Aлександр Кан '', ''text'': '' Вулкан клуб, вулкан слоты, казино вулкан и вулкан игровые автоматы - очень крутые приложения. С помощью них я получаю хорошие деньги. И советую вам качать '', ''date'': ''''}, 5: {''author'': '' '', ''text'': '' Вулкан игровые автоматы отличное приложение для тех кто выбирает азарт и конечно деньги. Вступайте в вулкан клуб и играйте казино вулкан. Всем рекомендую играть в вулкан слоты - это невероятный способ получить удовольствие, азарт и деньги.Удачи!!!!!! '', ''date'': ''''}, 6: {''author'': '' Алина Белан '', ''text'': '' Вулкан клуб отличное приложение, позволяющее реально заработать деньги. Вулкан игровые автоматы прямо в вашем телефоне-зарабатывай не выходя из дома! В приложении казино вулкан очень яркая и  реалистичная графика, с помощью вулкан слотов ты откроешь для себя простой и быстрый способ заработать. '', ''date'': ''27 октября 2017 г.''}, 7: {''author'': '' Фруктовый Сатана '', ''text'': '' Казино вулкан супер!  Никогда не верил что в игровых автоматах можно выиграть реальные деньги, но это так вулкан клуб тому доказательство! Очень нравятся вулкан слоты, здесь крутая графика  Всем советую качайте не пожалеете) '', ''date'': ''24 октября 2017 г.''}, 8: {''author'': '' Станислав Б '', ''text'': '' Вулкан игровые автоматы помогут вам реализовать все ваши мечты и желания! С помощью вулкан игровые автоматы вы можете достигнуть все вершине и покорить все финансовые пики, и избежать любые жизненные кризисы!!! '', ''date'': ''27 октября 2017 г.''}, 9: {''author'': '' сергей серега '', ''text'': '' Вулкан клуб очень крутое приложение. Это интересное и азартное игровое приложение. Здесь можно реально заработать деньги. '', ''date'': ''26 октября 2017 г.''}, 10: {''author'': '' Aлександр Кан '', ''text'': '' Вулкан клуб, вулкан слоты, казино вулкан и вулкан игровые автоматы - очень крутые приложения. С помощью них я получаю хорошие деньги. И советую вам качать '', ''date'': ''25 октября 2017 г.''}, 11: {''author'': '' '', ''text'': '' Вулкан игровые автоматы отличное приложение для тех кто выбирает азарт и конечно деньги. Вступайте в вулкан клуб и играйте казино вулкан. Всем рекомендую играть в вулкан слоты - это невероятный способ получить удовольствие, азарт и деньги.Удачи!!!!!! '', ''date'': ''27 октября 2017 г.''}, 12: {''author'': '' Anastasia King '', ''text'': '' В Казино Вулкан можно получить прибыль, если вы очень удачливы. Спасибо разработчикам за Игровые автоматы. Хорошее приложение. '', ''date'': ''27 октября 2017 г.''}, 13: {''author'': '' Оксана Бирюкова '', ''text'': '' Игровые автоматы Вулкан это супер мобильное приложение. Я рада что меня пригласили в это казино. И вам советую попробовать. Всем удачи!!! '', ''date'': ''26 октября 2017 г.''}, 14: {''author'': '' Гаяна Аракелян '', ''text'': '' Классное приложение. Очень люблю азартные игры. В вулкан это самое реальное и крутяшное казино '', ''date'': ''26 октября 2017 г.''}, 15: {''author'': '' Sergey Andreev '', ''text'': '' Любители расслабиться, только сейчас и только с приложением Вулкан клуб - казино Вулкан Вы сможете почувствовать себя истинным победителем в Вулкан игровые автоматы - Вулкан слоты. '', ''date'': ''25 октября 2017 г.''}, 16: {''author'': '' Ахмадишина Айгуль '', ''text'': '' ВУЛКАН КЛУБ ЭТО ЧТО-ТО НЕРЕАЛЬНОЕ ЗДЕСЬ ОЧЕНЬ МНОГО ВУЛКАН ИГРОВЫХ АВТОМАТОВ САМИ ПОПРОБУЙТЕ СКАЧАТЬ КАЗИНО ВУЛКАН '', ''date'': ''25 октября 2017 г.''}, 17: {''author'': '' '', ''text'': '' Игровые Автоматы - Клуб - отличное мобильное приложение. Самые лучшие игровые автоматы, щедрые бонусы, большие выигрыши, азарт и ррекрасное настроение. Советую. '', ''date'': ''24 октября 2017 г.''}, 18: {''author'': '' Стёпа Рожин '', ''text'': '' Вулкан клуб казино онлайн заработал много денег пойду поем в ресторане '', ''date'': ''27 октября 2017 г.''}, 19: {''author'': '' Алексей Гончаров '', ''text'': '' Вулкан клуб реально годный я уже на крааные сам щарбатываю '', ''date'': ''26 октября 2017 г.''}, 20: {''author'': '' Инна Сухова '', ''text'': '' Лучшие игровые автоматы и слоты Вулкан,реальное казино онлайн для любителей азарта.Казино вулкан,играть всем! '', ''date'': ''22 октября 2017 г.''}, 21: {''author'': '' AliceLiska '', ''text'': '' Казино вулкан клуб производит хорошее первое впечатление.Раньше я в них не верила,но теперь сижу целыми днями и зарабатываю. '', ''date'': ''24 октя