сем советую испытать свою удачу в казино вулкан на игровых автоматах и слотах. '', ''date'': ''25 октября 2017 г.''}, 44: {''author'': '' Ирина Польченко '', ''text'': ''Слоты'', ''date'': ''25 октября 2017 г.''}, 45: {''author'': '' '', ''text'': '' Если вы знаете что такое игровые автоматы казино Вулкан то можно будет преуспеть в этом приложении '', ''date'': ''27 октября 2017 г.''}}, ''description'': ''Любители расслабиться, только сейчас и только с нашим приложением Вы сможете почувствовать себя истинным победителем.\nНаше приложение не похоже на все остальные. Это самое реалистичное приложение, которое так же порадует Вас своим непревзойденным визуальным оформлением, лаконичным интерфейсом, невероятно плавным движением анимации и четким качественным изображением.\nВы обязательно оцените качество нашего приложения, ведь мы предлагаем только качественный и всем доступный контент.\nСкачивайте и устанавливайте Казино вулкан в абсолютно бесплатном режиме и попытайте удачу!'', ''top_developer'': False, ''updated'': ''13 октября 2017 г.'', ''reviews'': 365, ''developer_id'': None, ''url'': ''https://play.google.com/store/apps/details?id=ilioster.fikiutro.polpos'', ''interactive_elements'': [], ''current_version'': ''1.0'', ''free'': True, ''category'': [''GAME_CASINO'']}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('hewnok.reikas', 'ANDROID', '2017-10-28 04:48:35.369762', 'Игровые автоматы - Слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=hewnok.reikas', 'https://lh3.googleusercontent.com/SW1UueKwGmIHRIMmIfWEZLmSUAXObAKU9aWYMIjApXDoDCaDnGqatnO1p69ui0Zu7w', '2017-12-05 00:02:08.251239','' , '{''installs'': [10000, 50000], ''icon'': ''https://lh3.googleusercontent.com/SW1UueKwGmIHRIMmIfWEZLmSUAXObAKU9aWYMIjApXDoDCaDnGqatnO1p69ui0Zu7w'', ''description_html'': ''Мы тщательно разрабатывали и, наконец, выпустили очень интересное и занимательное приложение, встречайте – казино вулкан спешит покорить все топы мобильных приложений.<br/>Если Вам нравятся игровые слоты и беззаботные развлечения, то наша разработка подойдет именно для Вас. Не тратьте время на поиски игровых клубов – устройте его прямо у себя дома. И для этого нужно всего лишь скачать наше бесплатное и всем доступное приложение вулкан игровые автоматы.<br/>Вы непременно погрузитесь в яркий мир красочной графики и веселой плавной анимации, забавные звуковые эффекты только добавят красок вашим эмоциям. Вы без проблем разберетесь в меню и получите мгновенный отклик на любую команду.<br/>Не медлите, вступайте в вулкан клуб уже сейчас и ощутите миллион непередаваемых впечатлений!'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/hpLS-qTeCy_jKrTqT9a74MurfykqDhB6idhg4o9SuCK_a72-Kh0QDq427QC3sRKK9b4n=h900-rw'', ''https://lh3.googleusercontent.com/ss1zOi7ESxc8GR7XCsTmcwq5NvWGQ5VHYhPmPNQVNm8Im2_pt7Urk8aPkt2JSiffsU4D=h900-rw'', ''https://lh3.googleusercontent.com/KcGxm3HTvKOCnBQn5wowol66vCyjTqiNEz78ukAW10eI73WexxvkaKiiMY-HLp7qwXw=h900-rw''], ''developer_url'': None, ''developer_address'': None, ''app_id'': ''hewnok.reikas'', ''score'': 4.902995586395264, ''editors_choice'': False, ''ratings'': {1: 9, 2: 9, 3: 9, 4: 9, 5: 9}, ''recent_changes'': '''', ''thumbnails'': [''https://lh3.googleusercontent.com/hpLS-qTeCy_jKrTqT9a74MurfykqDhB6idhg4o9SuCK_a72-Kh0QDq427QC3sRKK9b4n=h310-rw'', ''https://lh3.googleusercontent.com/ss1zOi7ESxc8GR7XCsTmcwq5NvWGQ5VHYhPmPNQVNm8Im2_pt7Urk8aPkt2JSiffsU4D=h310-rw'', ''https://lh3.googleusercontent.com/KcGxm3HTvKOCnBQn5wowol66vCyjTqiNEz78ukAW10eI73WexxvkaKiiMY-HLp7qwXw=h310-rw''], ''title'': ''Игровые автоматы - Слоты'', ''size'': None, ''content_rating'': ''12+'', ''iap'': False, ''required_android_version'': ''4.1 или более поздняя'', ''developer'': ''omichel'', ''developer_email'': ''etojeshisha@gmail.com'', ''price'': ''0'', ''iap_range'': None, ''reviews_text'': {0: {''author'': '' Ivan Knyaz '', ''text'': '' Казино Вулкан и его игровые автоматы давно меня привлекают. Надо признаться, что я очень долго искал нормальные аппараты в интернете, но совершенно случайно наткнулся на это приложение. Сейчас чуть ли не целыми  зависаю в слотах и перестал работать.   Всем советую поиграть. '', ''date'': ''''}, 1: {''author'': '' Lidiya Solen '', ''text'': '' Долго искала нормальные игровые автоматы и слоты от Вулкан клуб и вот нашла наконец-то! Функционал  замечательный,  графика  четкая. Что  ещё  нужно для счастья? Казино Вулкан радует  нас все чаще. Советую. '', ''date'': ''''}, 2: {''author'': '' Sergey Andreev '', ''text'': '' Не тратьте время на поиски игровых клубов – устройте казино Вулкан прямо у себя дома. И для этого нужно всего лишь скачать бесплатное и доступное приложение вулкан игровые автоматы. Не медлите, вступайте в вулкан клуб уже сейчас и ощутите миллион непередаваемых впечатлений! '', ''date'': ''''}, 3: {''author'': '' Диана Габдуллина '', ''text'': '' Вулкан игровые автоматы очень удобны. Не вылетают, никуда не перенаправляют. Мне нравится '', ''date'': ''''}, 4: {''author'': '' злой чипсик '', ''text'': '' Вулкан это ебучие наебалово казино ни когда не уйдет в минус только вы все свои деньги проебете! Особенно в мобильном приложении. Если играть то на официальном сайте! '', ''date'': ''''}, 5: {''author'': '' Станислав Б '', ''text'': '' Казино вулкан можно качать сразу,не раздумывая! Это приложение созданной как раз для решения всех ваших финансовых проблем. Теперь покупка квартиры,яхты, личного самолёта будет щависить только от вашей настойчивости и упорства!! '', ''date'': ''''}, 6: {''author'': '' Ivan Knyaz '', ''text'': '' Казино Вулкан и его игровые автоматы давно меня привлекают. Надо признаться, что я очень долго искал нормальные аппараты в интернете, но совершенно случайно наткнулся на это приложение. Сейчас чуть ли не целыми  зависаю в слотах и перестал работать.   Всем советую поиграть. '', ''date'': ''26 октября 2017 г.''}, 7: {''author'': '' Lidiya Solen '', ''text'': '' Долго искала нормальные игровые автоматы и слоты от Вулкан клуб и вот нашла наконец-то! Функционал  замечательный,  графика  четкая. Что  ещё  нужно для счастья? Казино Вулкан радует  нас все чаще. Советую. '', ''date'': ''27 октября 2017 г.''}, 8: {''author'': '' Sergey Andreev '', ''text'': '' Не тратьте время на поиски игровых клубов – устройте казино Вулкан прямо у себя дома. И для этого нужно всего лишь скачать бесплатное и доступное приложение вулкан игровые автоматы. Не медлите, вступайте в вулкан клуб уже сейчас и ощутите миллион непередаваемых впечатлений! '', ''date'': ''25 октября 2017 г.''}, 9: {''author'': '' Диана Габдуллина '', ''text'': '' Вулкан игровые автоматы очень удобны. Не вылетают, никуда не перенаправляют. Мне нравится '', ''date'': ''25 октября 2017 г.''}, 10: {''author'': '' злой чипсик '', ''text'': '' Вулкан это ебучие наебалово казино ни когда не уйдет в минус только вы все свои деньги проебете! Особенно в мобильном приложении. Если играть то на официальном сайте! '', ''date'': ''23 октября 2017 г.''}, 11: {''author'': '' Станислав Б '', ''text'': '' Казино вулкан можно качать сразу,не раздумывая! Это приложение созданной как раз для решения всех ваших финансовых проблем. Теперь покупка квартиры,яхты, личного самолёта будет щависить только от вашей настойчивости и упорства!! '', ''date'': ''27 октября 2017 г.''}, 12: {''author'': " Alexandr Mit''kin ", ''text'': '' Отличное приложение если вдруг захотел скоротать пару часиков. Сам иной раз подвисаю в казино вулкан очень приятное приложение. '', ''date'': ''25 октября 2017 г.''}, 13: {''author'': '' Maksim Fomin '', ''text'': '' Казино вулкан - это набор азартных игр, которые представляют из себя некую бездну - залезешь и обратно никак . Но гамать можно господа '', ''date'': ''25 октября 2017 г.''}, 14: {''author'': '' Максим Сапожников '', ''text'': '' Неплохое приложение - виртуальное казино вулкан...Единственное, из-за чего не смог поставить 5 звёзд это вес приложения в 30 с лишним мегабайт... '', ''date'': ''25 октября 2017 г.''}, 15: {''author'': '' '', ''text'': '' Казино вулкан это надежное, безопасное, интересное приложение по заработку денег. Клуб игровых автоматов Вулкан дает возможность окунуться в мир азартной игры. '', ''date'': ''25 октября 2017 г.''}, 16: {''author'': '' Юлия Урюпина '', ''text'': '' Ура! Наступило то время когда казино Вулкан всегда со мной. Достаточно просто скачать приложение и в любое свободное время ощутить азарт и радость от игры. Ура!!! '', ''date'': ''26 октября 2017 г.''}, 17: {''author'': '' '', ''text'': '' Очень крутое приложение казино вулкан!!!!  Реально помогает выигрывать деньги. Вступая в клуб вулкан!!!)))) '', ''date'': ''25 октября 2017 г.''}, 18: {''author'': '' Anita Ritter '', ''text'': '' Захватывающие Вулкан игровые автоматы. Мне очень понравилось. Правда затягивает азартом и легкими деньками. '', ''date'': ''27 октября 2017 г.''}, 19: {''author'': '' Юрий Ли '', ''text'': '' Играть легко. Невозможно оторваться. Слоты доступны. Вулкан казино не подводит '', ''date'': ''27 октября 2017 г.''}, 20: {''author'': '' Ксения Самофеева '', ''text'': '' Вулкан клуб очень интересное и увлекательное приложение. В нем есть множество игровых направлений, например вулкан игровые автоматы и вулкан слоты. Играю в казино вулкан! '', ''date'': ''25 октября 2017 г.''}, 21: {''author'': '' Ольга Рязанова '', ''text'': '' Вулкан клуб вулкан казино вулкан игровые автоматы играть будешь дома до завтра '', ''date'': ''25 октября 2017 г.''}, 22: {''author'': '' Катя Супруненко '', ''text'': '' Одно из лучших приложений казино вулкан. Это доступное приложение -вулкан игровые автоматы. Самый классный вулкан клуб. '', ''date'': ''25 октября 2017 г.''}, 23: {''author'': '' Наталия Моисеева '', ''text'': '' Очень интересная идея.  Классные   и удобные слоты от казино  вулкан. '', ''date'': ''26 октября 2017 г.''}, 24: {''author'': '' '', ''text'': '' Очень крутое приложение поможет любому поднять денег '', ''date'': ''25 октября 2017 г.''}, 25: {''author'': '' Вова Подшибякин '', ''text'': '' Отличное казино вулкан ,где можно выиграть реальные деньги всем советую скачать!!! '', ''date'': ''25 октября 2017 г.''}, 26: {''author'': '' '', ''text'': '' Это супер приложение! Вулкан игровые автоматы, вулкан слоты, казино вулкан - очень крутые приложения. Вступайте в вулкан клуб!!! Всем рекомендую. '', ''date'': ''27 октября 2017 г.''}, 27: {''author'': '' '', ''text'': '' Заходите в вулкан игровые автоматы. Много  слотов. '', ''date'': ''25 октября 2017 г.''}, 28: {''author'': '' '', ''text'': '' Игровые слоты я очень много ожидал всем советую вулкан реальные деньги ваши '', ''date'': ''27 октября 2017 г.''}, 29: {''author'': '' Shimoa Mia '', ''text'': '' Вулкан игровые автоматы очень понравилось играть. Реальный вулкан клуб. '', ''date'': ''27 октября 2017 г.''}, 30: {''author'': '' Максим Кыров '', ''text'': '' Казино вулкан и игровые автоматы давно мне нравятся они меня очень привлекают свои выйгрышем '', ''date'': ''27 октября 2017 г.''}, 31: {''author'': '' Julliya '', ''text'': '' Супер вулкан. Извергает много денег. Играю каждый день.  Зарабатывай не выходя из дома '', ''date'': ''26 октября 2017 г.''}, 32: {''author'': '' '', ''text'': '' Игровые автоматы вымерли. Но теперь есть вулкан казино онлайн. Играть можно бесконечно. '', ''date'': ''27 октября 2017 г.''}, 33: {''author'': '' Стёпа Рожин '', ''text'': '' Вулкан клуб казино онлайн заработал много денег пойду поем в ресторане '', ''date'': ''27 октября 2017 г.''}, 34: {''author'': '' '', ''text'': '' Самое классное приложение, скачивайте и играйте, не пожалееете '', ''date'': ''26 октября 2017 г.''}, 35: {''author'': '' Ярик Заболоцких '', ''text'': '' Отлично, долго искал нормальный игровые автоматы и слоты от Вулкан клуб и вот нашел. Хорошая графика, замечательный функционал. Казино Вулкан радует нас все чаще '', ''date'': ''27 октября 2017 г.''}, 36: {''author'': '' '', ''text'': '' Хватит искать и играть в лоховские рулетки, скачивайте вулкан и зарабатывайте '', ''date'': ''27 октября 2017 г.''}, 37: {''author'': '' '', ''text'': '' Супер игра вулкан принесет вам много бабла играйте и зарабатывайте '', ''date'': ''27 октября 2017 г.''}, 38: {''author'': '' Valera Dovbiy '', ''text'': '' Казино, вулкан вулкан игравые автаматы вулкан клуб можно получить деньги '', ''date'': ''25 октября 2017 г.''}, 39: {''author'': '' '', ''text'': '' Казино Вулкан отличный способ заработка, все легко и просто. Самое лучшее приложение! '', ''date'': ''26 октября 2017 г.''}, 40: {''author'': '' Aleksej Andreev '', ''text'': '' Вулкан супер прога норм прям пойдёт молодцы '', ''date'': ''27 октября 2017 г.''}, 41: {''author'': '' Автурхан Дутаев '', ''text'': '' Казино вулкан . вулкан игровой автоматы . казино клуб великолепной от '', ''date'': ''27 октября 2017 г.''}, 42: {''author'': '' Артем Лазарев '', ''text'': '' Казино вулкан и его игровые автоматы очень хорошее приложение, реально можно поднять денег. '', ''date'': ''27 октября 2017 г.''}, 43: {''author'': '' Moni Bel '', ''text'': '' Очень приятно играть в это казино, удобный функционал, и всегда на связи поддержка. '', ''date'': ''24 октября 2017 г.''}, 44: {''author'': '' '', ''text'': '' Казино вулкан бесконечная игра и это весело. '', ''date'': ''26 октября 2017 г.''}, 45: {''author'': '' Александр Ткаченко '', ''text'': '' Казино вулкан игровые автоматы слоты ежедневные бонусы и призы онлайн для любителей азарта '', ''date'': ''24 октября 2017 г.''}}, ''description'': ''Мы тщательно разрабатывали и, наконец, выпустили очень интересное и занимательное приложение, встречайте – казино вулкан спешит покорить все топы мобильных приложений.\nЕсли Вам нравятся игровые слоты и беззаботные развлечения, то наша разработка подойдет именно для Вас. Не тратьте время на поиски игровых клубов – устройте его прямо у себя дома. И для этого нужно всего лишь скачать наше бесплатное и всем доступное приложение вулкан игровые автоматы.\nВы непременно погрузитесь в яркий мир красочной графики и веселой плавной анимации, забавные звуковые эффекты только добавят красок вашим эмоциям. Вы без проблем разберетесь в меню и получите мгновенный отклик на любую команду.\nНе медлите, вступайте в вулкан клуб уже сейчас и ощутите миллион непередаваемых впечатлений!'', ''top_developer'': False, ''updated'': ''18 октября 2017 г.'', ''reviews'': 701, ''developer_id'': None, ''url'': ''https://play.google.com/store/apps/details?id=hewnok.reikas'', ''interactive_elements'': [], ''current_version'': ''1.0'', ''free'': True, ''category'': [''GAME_CASINO'']}');
