INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.eurorussslot.playavtomat', 'ANDROID', '2017-10-28 04:48:27.840380', 'Казино Слотов - Игровые автоматы Шарки', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.eurorussslot.playavtomat', 'https://lh3.googleusercontent.com/zFzE6uWTrTepkWtw8K7_wIFTaCAMJyX9W3rAcJScvLi2CW-Eya6GTtneogsqPl39QQ', '2017-12-18 23:30:42.365361','' , '{''installs'': [10000, 50000], ''icon'': ''https://lh3.googleusercontent.com/zFzE6uWTrTepkWtw8K7_wIFTaCAMJyX9W3rAcJScvLi2CW-Eya6GTtneogsqPl39QQ'', ''description_html'': ''Если вам надоела вся эта бытовая суета, эта учеба или работа, и все кажется рутинным, значит пора разрядится! Сыграть в виртуальное казино и поднять джек-пот, покрутить барабаны и сыграть в игровые автоматы. У нас в приложении вы найдете много слотов, как из старых, так и из новых. В любом случае выиграть у нас вы всегда сможете с легкостью. Если вы хотите участвовать в еженедельных турнирах, получать бонусы, а также попробовать интересные акционные предложения, то вам однозначно надо ставить наше приложение.<br/><br/>С нашим приложением вы можете окунуться в полные азарта воды удачи, ощутить вкус победы и показать всем чего вы стоите на самом деле. В игровые автоматы вы можете играть где угодно, где есть интернет соединение для связи с нашими серверами (на них расчитывается джек-пот). Слоты вы можете выбрать как на одну так и на 20 и более линий. Отличные бонусы позволяют играть долго и с огромным удовольствием, ведь это удача на халяву! Казино в виртуальном мире интернета стало так доступно с нашим симулятором игровых автоматов. Играйте онлайн и побеждайте вместе с нами!'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/PtbzjH93-8F29SvzSc369qGyWPWgyLWEEBzPJBMv8HfsEkeuqIHWQdX9jAhpkOWoPQc=h900-rw'', ''https://lh3.googleusercontent.com/pQ2B_YWWmDjQ3mNoF9JCL7aNPJ2TgI7lKZL1v3k0VNODyuPGeOQ1RtENYUql9E4RZNs=h900-rw'', ''https://lh3.googleusercontent.com/XhSycAMXnWyPlMF6QRGGDyyiEv8kOroCT-6eorrN7ifBG3lnokL9eGi-LULJaXfVIkV5=h900-rw'', ''https://lh3.googleusercontent.com/Gx1lz--UM5Pc9ubmrEqkUwizOJ4bh0GSLAyirIvY9-C2cNnzab14WOuLIHGnLmSsrQ=h900-rw''], ''developer_url'': None, ''developer_address'': None, ''app_id'': ''com.eurorussslot.playavtomat'', ''score'': 4.812162399291992, ''editors_choice'': False, ''ratings'': {1: 4, 2: 4, 3: 4, 4: 4, 5: 4}, ''recent_changes'': '''', ''thumbnails'': [''https://lh3.googleusercontent.com/PtbzjH93-8F29SvzSc369qGyWPWgyLWEEBzPJBMv8HfsEkeuqIHWQdX9jAhpkOWoPQc=h310-rw'', ''https://lh3.googleusercontent.com/pQ2B_YWWmDjQ3mNoF9JCL7aNPJ2TgI7lKZL1v3k0VNODyuPGeOQ1RtENYUql9E4RZNs=h310-rw'', ''https://lh3.googleusercontent.com/XhSycAMXnWyPlMF6QRGGDyyiEv8kOroCT-6eorrN7ifBG3lnokL9eGi-LULJaXfVIkV5=h310-rw'', ''https://lh3.googleusercontent.com/Gx1lz--UM5Pc9ubmrEqkUwizOJ4bh0GSLAyirIvY9-C2cNnzab14WOuLIHGnLmSsrQ=h310-rw''], ''title'': ''Казино Слотов - Игровые автоматы Шарки'', ''size'': None, ''content_rating'': ''12+'', ''iap'': False, ''required_android_version'': ''4.0.3 или более поздняя'', ''developer'': ''alucard'', ''developer_email'': ''tropinkinarchi@gmail.com'', ''price'': ''0'', ''iap_range'': None, ''reviews_text'': {0: {''author'': '' Ivan Knyaz '', ''text'': '' Казино Вулкан и его игровые автоматы давно меня привлекают. Надо признаться, что я очень долго искал нормальные аппараты в интернете, но совершенно случайно наткнулся на это приложение. Сейчас чуть ли не целыми  зависаю в слотах и перестал работать.   Всем советую поиграть. '', ''date'': ''''}, 1: {''author'': '' Sergey Andreev '', ''text'': '' Надоела вся эта бытовая суета, эта учеба или работа, и все кажется рутинным? Пора разрядится! Сыграть в виртуальное казино и поднять джек-пот, покрутить барабаны и сыграть в игровые автоматы. '', ''date'': ''''}, 2: {''author'': '' Серый Цекот '', ''text'': '' Вулкан казино хороший способ разбогатеть, главное терпение и выдержка. Денег море- ра