INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('flippos.treglop.ninaeert', 'ANDROID', '2017-10-28 04:48:31.010116', 'Клуб удачи - Игровые автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=flippos.treglop.ninaeert', 'https://lh3.googleusercontent.com/3h6HvR5LD-6lQK3WUbIMMJoqhaimK61XyAyNR02Kp9P-RU1fr72KSA4AKhMvI34zeyk', '2017-11-10 06:35:00.000000','' , '{''installs'': [10000, 50000], ''icon'': ''https://lh3.googleusercontent.com/3h6HvR5LD-6lQK3WUbIMMJoqhaimK61XyAyNR02Kp9P-RU1fr72KSA4AKhMvI34zeyk'', ''description_html'': ''Для всех любителей развлечений мы выпустили самую стильную новинку. Наше приложение – настоящий прорыв в мире увлекательных досуговых приложений. Мы не будем перечислять всех преимуществ, Вы все увидите сами, а для этого не нужно иметь продвинутых устройств, приложение в свободном доступе для любого гаджета. Лишь немного памяти и интернет соединение – больше ничего не требуется.<br/>Вас точно порадует наше красочное внешнее оформление, все картинки насыщенные и яркие, анимация осуществляется невероятно плавно. В меню и управлении игры Вы разберетесь в считанные минуты, и не важно, продвинутый Вы пользователь или новичок.<br/>Не упустите уникальную возможность бесплатно получить Казино вулкан клуб в Ваше любимое устройство, и мы поможем Вам погрузиться в мир незабываемых впечатлений с яркими и забавными слотами.'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/fYJTJE7odfSBjk-KuMIAxcehNjKbGIEHYKSNRDkMhSMqkRP7hoGD9nXJUv7YM1KSTfM=h900-rw'', ''https://lh3.googleusercontent.com/FNon00GA7DHuIGSrpV0juYhCAR1KI_TacaA1W46EhjfFpvDaEdVZfpGo9CEJ-SYHkg=h900-rw'', ''https://lh3.googleusercontent.com/npSjNStGQg_r0Ev7XareIeiT_aSrf-JB8aWuKLuZGW12B8TLimphbMUUyarcrcrp4Dw=h900-rw''], ''developer_url'': None, ''developer_address'': None, ''app_id'': ''flippos.treglop.ninaeert'', ''score'': 4.731578826904297, ''editors_choice'': False, ''r