7 г.''}, 21: {''author'': '' '', ''text'': '' Хорошее приложение казино вулкан! Вулкан игровые автоматы и вулкан слоты выполнены в отличной графике! Все в Вулкан клуб за удачей! '', ''date'': ''25 октября 2017 г.''}, 22: {''author'': '' Юлия Урюпина '', ''text'': '' Казино Вулкан очень интересное и увлекательное приложение для меня. Мне понравилось и я довольна! '', ''date'': ''26 октября 2017 г.''}, 23: {''author'': '' Настя Креницина '', ''text'': '' Захватывающее приложение Казино Вулкан! Настоящий Лас-Вегас прямо у тебя дома! '', ''date'': ''24 октября 2017 г.''}, 24: {''author'': '' Павел Машуков '', ''text'': '' Казино вулкан самое лучшее приложение которое я встречал. Советую всем скачать ее '', ''date'': ''21 октября 2017 г.''}, 25: {''author'': '' Вад Сол '', ''text'': '' Клуб удачи Вулкан удобное приложение для игры в слоты онлайн, бонусы на депозиты и круглосуточная поддержка в самом честном онлайн казино Вулкан. '', ''date'': ''23 октября 2017 г.''}, 26: {''author'': '' Aleks Safargaliev '', ''text'': '' Это настоящий Вулкан клуб с разнообразием игровых автоматов и слотов. Увлекательно, как всё у Вулкана. '', ''date'': ''26 октября 2017 г.''}, 27: {''author'': '' Денис Бородулин '', ''text'': '' Вулкан клуб захватывает мир! Это онлайн казино с игровыми автоматами под множеством имён уже залезло в твою голову! Тебе не спастись от слотов! '', ''date'': ''27 октября 2017 г.''}, 28: {''author'': '' Наталия Гусева '', ''text'': '' Вулкан слоты - это хорошая игра, хорошее приложение. Всем советую '', ''date'': ''26 октября 2017 г.''}, 29: {''author'': '' Никита Синявский '', ''text'': '' Короче ни чего удивительного я в этом казино от 🌋 клуб не увидел,но ровно до того момента пока не стал выигрывать по тыще в день!если не веришь заходи и ты убедишся в этом.. '', ''date'': ''26 октября 2017 г.''}, 30: {''author'': '' Сергей Юркевич '', ''text'': '' Казино вулкан это отличное место где можно с пользой провести время '', ''date'': ''25 октября 2017 г.''}, 31: {''author'': '' борей северный '', ''text'': '' Вулкан игровые автоматы как всегда радуют нас своими новинками. '', ''date'': ''25 октября 2017 г.''}, 32: {''author'': '' '', ''text'': '' Приложение игровые автоматы клуб казино вулкан очень прикольная штука для развлечений онлайн. '', ''date'': ''24 октября 2017 г.''}, 33: {''author'': '' сергей гавриченко '', ''text'': '' Все понятно выиграл пока правда не много всем советую играть и поднимать бабки '', ''date'': ''27 октября 2017 г.''}, 34: {''author'': '' Серега '', ''text'': '' Вулкан клуб это новая игровая площадка для отдыха и хорошего досуга, а так же для пополнения своего кошелька. '', ''date'': ''23 октября 2017 г.''}, 35: {''author'': '' '', ''text'': '' Казино вулкан лучшие игровые автоматы,разработчикам спасибо молодцы ребята 5+ '', ''date'': ''21 октября 2017 г.''}, 36: {''author'': '' Yuri Smi '', ''text'': '' Классное казино вулкан выпало 10 free спинов, удалось не плохо подзаработать все это происходило с прекрасной графикой и без зависания '', ''date'': ''25 октября 2017 г.''}, 37: {''author'': '' Светлана Р. '', ''text'': '' Вулкан игровые автоматы для любителей азартных игр. Много вариантов игровых автоматов, красочные слоты. Играйте и выигрыши не заставят себя ждать. Удачи всем '', ''date'': ''26 октября 2017 г.''}, 38: {''author'': '' Александр Рябошапко '', ''text'': '' Отлично! Вулкан игровые атоматы - это одно из самых полезных приложений! Всё круто, рекомендую. '', ''date'': ''24 октября 2017 г.''}, 39: {''author'': '' '', ''text'': '' Вулкан казино  буду  пользоваться.  Можно  хорошо  заработать. '', ''date'': ''25 октября 2017 г.''}, 40: {''author'': '' '', ''text'': '' Всё очень понятно и красиво. Вулкан просто то что надо.Очень хороший интерфейс '', ''date'': ''23 октября 2017 г.''}, 41: {''author'': '' Sir. СанСаныч '', ''text'': '' Никогда не думал, что буду играть в игровые автоматы, но казино вулкан приятно удивило '', ''date'': ''26 октября 2017 г.''}, 42: {''author'': '' '', ''text'': '' Отличное приложение! Хорошие выигрыши! Сначала не верил сам, но решил попробовать и впервые сорвал отличный джекпот! Всем советую! '', ''date'': ''27 октября 2017 г.''}, 43: {''author'': '' Zinfira Z '', ''text'': '' Самое лучшее приложение Вулкан игровые автоматы.Очень интересная вещь. Всем рекомендую. Скачивайте, не пожалеете. '', ''date'': ''25 октября 2017 г.''}, 44: {''author'': '' Андрей Николаев '', ''text'': '' Всегда с тобой казино вулкан накал страстей и азарта множество игровых ситуаций супер игровые автоматы красочные слоты !!! '', ''date'': ''26 октября 2017 г.''}, 45: {''author'': '' КаРуСеЛь ЖиЗнИ '', ''text'': '' хорошее приложение очень очень нравится,буду играть дальше,желаю удачи. '', ''date'': ''27 октября 2017 г.''}}, ''description'': ''Для всех любителей развлечений мы выпустили самую стильную новинку. Наше приложение – настоящий прорыв в мире увлекательных досуговых приложений. Мы не будем перечислять всех преимуществ, Вы все увидите сами, а для этого не нужно иметь продвинутых устройств, приложение в свободном доступе для любого гаджета. Лишь немного памяти и интернет соединение – больше ничего не требуется.\nВас точно порадует наше красочное внешнее оформление, все картинки насыщенные и яркие, анимация осуществляется невероятно плавно. В меню и управлении игры Вы разберетесь в считанные минуты, и не важно, продвинутый Вы пользователь или новичок.\nНе упустите уникальную возможность бесплатно получить Казино вулкан клуб в Ваше любимое устройство, и мы поможем Вам погрузиться в мир незабываемых впечатлений с яркими и забавными слотами.'', ''top_developer'': False, ''updated'': ''13 октября 2017 г.'', ''reviews'': 380, ''developer_id'': None, ''url'': ''https://play.google.com/store/apps/details?id=flippos.treglop.ninaeert'', ''interactive_elements'': [], ''current_version'': ''1.0'', ''free'': True, ''category'': [''GAME_CASINO'']}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.zenomaza.zen', 'ANDROID', '2017-10-28 04:48:24.410939', 'Слоты и игровые автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.zenomaza.zen', 'https://lh3.googleusercontent.com/AaTCeOqVj-wV2rGpfd5lNRCoxoNGxgGJ2SQGqprefJwIaPCfVRPG4DRGPCSY5j92ir8', '2017-11-10 07:34:00.000000','' , '{''installs'': [10000, 50000], ''icon'': ''https://lh3.googleusercontent.com/AaTCeOqVj-wV2rGpfd5lNRCoxoNGxgGJ2SQGqprefJwIaPCfVRPG4DRGPCSY5j92ir8'', ''description_html'': ''Спешите установить легендарные игровые автоматы от всеми известного казино вулкан<br/><br/>👍 Мгновенные выводы<br/>👍 Музыка, которая поможет окунуться в атмосферу<br/>👍 Огромные бонусы новым игрокам<br/>👍 Вулкан твоих эмоций<br/>👍 Самые крупные бонусы на первый депозит<br/>👍 Качественное обслуживание в лице круглосуточной технической поддержки<br/><br/>Наше <b>казино вулкан</b> онлайн уже зарекомендовало себя на российском рынке как качественное и доступное развлечение для любителей слотов. Установите виртуальное казино прямо сейчас. <br/><br/>Да прибудет с вами удача 👍'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/9D1J2293L7xee7tiv_Mistk0_j2xxHUq3jP1fdLWKms2jX3SaUL6jp5SC9DldokaOJQ=h900-rw'', ''https://lh3.googleusercontent.com/gY_1a5c4DPYaHTAMphN2P6BfeeCkPuzhGO4Ke2QjyKWAU6lj-KjaY9r6ANRaNlEBZ0Xa=h900-rw'', ''https://lh3.googleusercontent.com/DYLVYKSBhPfTbd_dvw6to3pAHPGAHy3hW7g2JN5tpG22oOAVseYn8KM8bKurOO3-MRw=h900-rw'', ''https://lh3.googleusercontent.com/KrZCzQmrDYiGZnc5C6CL9Tp_TR2rD-r28B0iuU1y2Q_kQZaSv9BO50iXPKbrux5ny-kN=h900-rw'', ''https://lh3.googleusercontent.com/VNbjtsbEGHjtwlO1WH8YxFpL6Id6DbI1Hvl03NYBpgkmzNY7FmVBwueVc1DpNW4p1DgH=h900-rw'', ''https://lh3.googleusercontent.com/wQ7NNc-yQ52-gKttRD8xj9bxSkRlRWVbScZ6iPeXuV-P6PLF9_CZa9cg2ly6Pu3asoY=h900-rw'', ''https://lh3.googleusercontent.com/A71M65hDePZ_BDkofwU0XRtXLePJY-9cDpy6oTd