INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('slots.vozduh.casino', 'ANDROID', '2017-10-28 04:48:34.217835', 'Клуб - Игровые автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=slots.vozduh.casino', 'https://lh3.googleusercontent.com/cAqSnBiZcn6v46b2Pkc8rB3rYacoobPaJlNH_f-_xEwoH5zEhfyAUeM6R8Y0_g3JTQ', '2017-12-02 02:04:00.000000','' , '{''installs'': [10000, 50000], ''icon'': ''https://lh3.googleusercontent.com/cAqSnBiZcn6v46b2Pkc8rB3rYacoobPaJlNH_f-_xEwoH5zEhfyAUeM6R8Y0_g3JTQ'', ''description_html'': ''Иногда хочется отвлечься от суеты будничных дней и отдохнуть, развлечься. Лучше всего для этого подойдет посещение казино вулкан. Мир азартных игр и слоты увлекает каждого, ведь играть и побеждать – что может быть лучше? В этом мире есть свои правила, своя история, свои секреты.<br/><br/>Казино вулкан появилось в России одним из первых, автоматы устанавливались чуть ли не в каждом крупном городе. Честная игра, интересные игровые автоматы, а так же игры с реальными соперниками – все это сделало игровые клубы очень посещаемыми. Игроки делились своими секретами, информации о крупных выигрышах разносилась мгновенно. Любой гемблер мечтал сорвать джекпот казино вулкан, и на этой почве появилось множество суеверий и примет, связанных с игровыми автоматами.<br/><br/>Было много разговоров о том, что сорвать куш на игровых автоматах невозможно. Но выигрыши были и не маленькие, часто совершенно случайные. Самый больший джекпот в мире на игровых автоматах выиграл один молодой человек из Америки. Он просто хотел «убить» время в ожидании баскетбольного матча и зашел поиграть в слоты. Его доход составил 40 миллионов долларов!<br/><br/>В вулкане игра всегда велась честно, отдача автоматов на мировом уровне, а это до 90%. Игровые салоны этого казино всегда были полны народу, а суммы выигрышей были просто баснословны. В наши дни основная игра перешла в интернет. Сеть казино вулкан также перебралось в онлайн. И, как утверждают знатоки, шансы на победу в этом случае гораздо выше!<br/>Буквально на днях появилась информация, что был получен выигрыш в 25 000 долларов. Но за всю историю вулкана это не самый большой куш. Имя игрока правда не известно, казино не разглашает информацию о своих клиентах. Попробовать стать миллионером теперь может каждый – ведь игра онлайн доступна всем. И кто знает, может про ваш выигрыш, тоже будут слагать легенды. А новичкам можно попробовать силы в бесплатной игре!<br/><br/>Для Вас круглосуточная поддержка в режиме онлайн 24 на 7.<br/>Бонусы новым игрокам<br/>Ежедневные фриспины<br/>С каждым днем все больше новых слотов.<br/><br/>Вулкан азарта - поймай и ты удачу за хвост!'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/HkqKGQjTzRKHD0cnrETKHzbCp18EOltF1v1hDAMp2w7ULeEnzJbcvcTvipBd6SEB3P1S=h900-rw'', ''https://lh3.googleusercontent.com/5cVm5eUupSxyQx-dpmj4tQ94cCLglqhhEQ-81Y4zMr7vPkQ-gtMGfbMzuJuw65gsjKk=h900-rw'', ''https://lh3.googleusercontent.com/ykR0dLf_7ej18ecYDySC8WSuLrVQupRiXaPxBezaKWOuMi9CDD0eXdFRc_tsFUFAoA=h900-rw'', ''https://lh3.googleusercontent.com/DWpFuv5JpWFynf5kCST2jGFj_QtMdJa9XqGm0APR65k4KcbvYbCbHNJbsI7ylq7TYg=h900-rw'', ''https://lh3.googleusercontent.com/wZW-g0_fVXPvtXnBg7wUclGyWzhRB92wesVsOvwvO4EyRhv3AwJYryyuwkG6UywKjPRR=h900-rw''], ''developer_url'': None, ''developer_address'': None, ''app_id'': ''slots.vozduh.casino'', ''score'': 4.708206653594971, ''editors_choice'': False, ''ratings'': {1: 12, 2: 12, 3: 12, 4: 12, 5: 12}, ''recent_changes'': '''', ''thumbnails'': [''https://lh3.googleusercontent.com/HkqKGQjTzRKHD0cnrETKHzbCp18EOltF1v1hDAMp2w7ULeEnzJbcvcTvipBd6SEB3P1S=h310-rw'', ''https://lh3.googleusercontent.com/5cVm5eUupSxyQx-dpmj4tQ94cCLglqhhEQ-81Y4zMr7vPkQ-gtMGfbMzuJuw65gsjKk=h310-rw'', ''https://lh3.googleusercontent.com/ykR0dLf_7ej18ecYDySC8WSuLrVQupRiXaPxBezaKWOuMi9CDD0eXdFRc_tsFUFAoA=h310-rw'', ''https://lh3.googleusercontent.com/DWpFuv5JpWFynf5kCST2jGFj_Q