uthor'': '' Серый Лукин '', ''text'': '' Игровые автоматы вулкан супер предложение '', ''date'': ''24 октября 2017 г.''}, 45: {''author'': '' Сергей Александров '', ''text'': '' Казино вулкан интересная  игра, много выигрышей реальных денег, полезное приложение '', ''date'': ''22 октября 2017 г.''}}, ''description'': ''Иногда хочется отвлечься от суеты будничных дней и отдохнуть, развлечься. Лучше всего для этого подойдет посещение казино вулкан. Мир азартных игр и слоты увлекает каждого, ведь играть и побеждать – что может быть лучше? В этом мире есть свои правила, своя история, свои секреты.\nКазино вулкан появилось в России одним из первых, автоматы устанавливались чуть ли не в каждом крупном городе. Честная игра, интересные игровые автоматы, а так же игры с реальными соперниками – все это сделало игровые клубы очень посещаемыми. Игроки делились своими секретами, информации о крупных выигрышах разносилась мгновенно. Любой гемблер мечтал сорвать джекпот казино вулкан, и на этой почве появилось множество суеверий и примет, связанных с игровыми автоматами.\nБыло много разговоров о том, что сорвать куш на игровых автоматах невозможно. Но выигрыши были и не маленькие, часто совершенно случайные. Самый больший джекпот в мире на игровых автоматах выиграл один молодой человек из Америки. Он просто хотел «убить» время в ожидании баскетбольного матча и зашел поиграть в слоты. Его доход составил 40 миллионов долларов!\nВ вулкане игра всегда велась честно, отдача автоматов на мировом уровне, а это до 90%. Игровые салоны этого казино всегда были полны народу, а суммы выигрышей были просто баснословны. В наши дни основная игра перешла в интернет. Сеть казино вулкан также перебралось в онлайн. И, как утверждают знатоки, шансы на победу в этом случае гораздо выше!\nБуквально на днях появилась информация, что был получен выигрыш в 25 000 долларов. Но за всю историю вулкана это не самый большой куш. Имя игрока правда не известно, казино не разглашает информацию о своих клиентах. Попробовать стать миллионером теперь может каждый – ведь игра онлайн доступна всем. И кто знает, может про ваш выигрыш, тоже будут слагать легенды. А новичкам можно попробовать силы в бесплатной игре!\nДля Вас круглосуточная поддержка в режиме онлайн 24 на 7.\nБонусы новым игрокам\nЕжедневные фриспины\nС каждым днем все больше новых слотов.\nВулкан азарта - поймай и ты удачу за хвост!'', ''top_developer'': False, ''updated'': ''13 октября 2017 г.'', ''reviews'': 329, ''developer_id'': None, ''url'': ''https://play.google.com/store/apps/details?id=slots.vozduh.casino'', ''interactive_elements'': [], ''current_version'': ''1.0.0'', ''free'': True, ''category'': [''GAME_CASINO'']}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.origgameclub.play', 'ANDROID', '2017-10-28 04:48:18.610710', 'Клуб игровые слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.origgameclub.play', 'https://lh3.googleusercontent.com/SmO-7Nv6aVgKkQle55zbVvEudpw_lzQ-wnCGY9_K1Z8AOJPizoG93J-u9_kLUedLig', '2017-11-06 18:32:00.000000','' , '{''installs'': [100000, 500000], ''icon'': ''https://lh3.googleusercontent.com/SmO-7Nv6aVgKkQle55zbVvEudpw_lzQ-wnCGY9_K1Z8AOJPizoG93J-u9_kLUedLig'', ''description_html'': ''<b>Самые популярные игровые автоматы на вашем телефоне или планшете совершенно бесплатно!</b> <br/><br/>Бонусные раунды, разнообразные сюжетные линии игровых автоматов вулкан, двойные выигрыши и призы! Великолепная возможность опробовать свою стратегию, набраться игрового опыта! <br/><br/><b> Испытайте радость от побед в Игровых Автоматах - Клуб удачи!</b>  Огромное количество людей уже играют с нами! Вы любите азарт и хотите постоянно выигрывать джекпоты? Наше казино «Игровые Автоматы Слоты Удачи» именно для вас! Окунитесь в атмосферу настоящего казино, круглосуточная доступность и поддержка игровых автоматов! Время за игрой пройдет незаметно, вы сможете отдохнуть и прекрасно провести время.<br/><br/>Главными плюсами к твоему состоянию станет:<br/><br/>👍 Огромная поддержка бонусами на старте игры<br/>👍 Весомые бонусы на первый депозит<br/>👍 Фри спины<br/>👍 Круглосуточная помощь <br/><br/><b> Наше казино онлайн уже зарекомендовало себя на российском рынке</b>  как качественное и доступное развлечение для любителей слотов. Скачай виртуальное казино прямо сейчас. К слову, это займет всего несколько секунд. Наслаждайся игрой!'', ''video'': None, ''screenshots'': [''https://lh3.googleusercontent.com/LaJefQqDaQsg7NOlqjIzgwrXSHJCWTi6iZAdBE_V0ykyLGWhKATuSlU_PRbEz9edhJ85=h900-rw'', ''https://lh3.googleusercontent.com/m3xVskJGqRrhq9F7itDyYzWtJ9Dae1ZI3OKwC1f5kv-SKD6J