 меня небольшой доход, хватает на еду и оплату аренды квартиры. Я много раз слышала о Вулкан казино и вот решила установить приложение. В короткие сроки я поправила своё финансовое положение благодаря Вулкан онлайн. Теперь советую Вулкан своим друзьям и вам! '', ''date'': ''''}, 1: {''author'': '' владимир ситчихин '', ''text'': '' Отличное приложение - Вулкан. Я много очень слышал про эти игровые автоматы. Но вот на днях увидел как друг играет Вулкан онлайн, и поднимает реальные деньги. А сегодня сам загрузил вот уже поднял не большую сумму. Это прям Вулкан казино . )))) '', ''date'': ''''}, 2: {''author'': '' давид салимов '', ''text'': '' В принципе можно поиграть до определенного момента. С 1000 поднял до 7500, а после пролетел в 0. Пополнял счет 3 раза и всё в пустую. В общем если есть время и лишние деньги, то можно провести время. А если кто то решил вложить  последние деньги и заработать, то мой вам совет не делайте этого. '', ''date'': ''''}, 3: {''author'': '' Клава Кентавра '', ''text'': '' Вулкан казино - отличное приложение. Я игрок по жизни, все время бы этим занималась. + это прибыльно, что очень важно. Можно поднять неплохие деньги, всем советую! '', ''date'': ''''}, 4: {''author'': '' Рука Лицо '', ''text'': '' НАЕБАЛОВО!! Я пополнил счёт на 50 руб. но приложение показывало 0 руб. Я перезошёл и.... Он не запускается. Отлично я прое*ал 50 руб. (Если разарабы это читают то помогите пж) '', ''date'': ''''}, 5: {''author'': '' '', ''text'': '' Вулкан казино вполне неплох, если у вас есть свободное время. Да и если вам срочно нужны деньги — вулкан может вам их дать. Однако смотрите сами, у меня всё получилось. '', ''date'': ''''}, 6: {''author'': '' '', ''text'': '' У меня небольшой доход, хватает на еду и оплату аренды квартиры. Я много раз слышала о Вулкан казино и вот решила установить приложение. В короткие сроки я поправила своё финансовое положение благодаря Вулкан онлайн. Теперь советую Вулкан своим друзьям и вам! '', ''date'': ''23 октября 2017 г.''}, 7: {''author'': '' владимир ситчихин '', ''text'': '' Отличное приложение - Вулкан. Я много очень слышал про эти игровые автоматы. Но вот на днях увидел как друг играет Вулкан онлайн, и поднимает реальные деньги. А сегодня сам загрузил вот уже поднял не большую сумму. Это прям Вулкан казино . )))) '', ''date'': ''24 октября 2017 г.''}, 8: {''author'': '' давид салимов '', ''text'': '' В принципе можно поиграть до определенного момента. С 1000 поднял до 7500, а после пролетел в 0. Пополнял счет 3 раза и всё в пустую. В общем если есть время и лишние деньги, то можно провести время. А если кто то решил вложить  последние деньги и заработать, то мой вам совет не делайте этого. '', ''date'': ''23 октября 2017 г.''}, 9: {''author'': '' Клава Кентавра '', ''text'': '' Вулкан казино - отличное приложение. Я игрок по жизни, все время бы этим занималась. + это прибыльно, что очень важно. Можно поднять неплохие деньги, всем советую! '', ''date'': ''23 октября 2017 г.''}, 10: {''author'': '' Рука Лицо '', ''text'': '' НАЕБАЛОВО!! Я пополнил счёт на 50 руб. но приложение показывало 0 руб. Я перезошёл и.... Он не запускается. Отлично я прое*ал 50 руб. (Если разарабы это читают то помогите пж) '', ''date'': ''22 октября 2017 г.''}, 11: {''author'': '' '', ''text'': '' Вулкан казино вполне неплох, если у вас есть свободное время. Да и если вам срочно нужны деньги — вулкан может вам их дать. Однако смотрите сами, у меня всё получилось. '', ''date'': ''22 октября 2017 г.''}, 12: {''author'': '' '', ''text'': '' Спасибо за науку деньги хрен выведены. Как на пополнение так 2 секунды.как выигрыш снять так хреново выведены. Сношу '', ''date'': ''22 октября 2017 г.''}, 13: {''author'': '' Дарина Халиуллина '', ''text'': '' Давно хотела но не как не решилась попробовать.  А вчера скачала и теперь не могу оторваться. Лёгкое управление, качественная графика. Можно без труда поднять много денег. Вулкан лучшая в мире площадка) '', ''date'': ''17 октября 2017 г.''}, 14: {''author'': '' Анна Мироненко '', ''text'': '' Скачала приложение Вулкан мне оно очень понравилось. Больше всего понравилось как сделано он все доступно даже для чайника. Радует что Вулкан онлайн и можно в любой момент играть. Так что советую казино Вулкан '', ''date'': ''23 октября 2017 г.''}, 15: {''author'': '' '', ''text'': '' Страшна эта игра. Все прыгает(кнопки), полностью экран не открывает, виснет, даже зарегистрироваться нет возможности из- за глюков! '', ''date'': ''15 октября 2017 г.''}, 16: {''author'': '' '', ''text'': '' Если честно очень плохо потомучто я только зашла и там мне пишут (мы неможем вам открыть эту програму) да пошли вы в ж... реально достали '', ''date'': ''21 октября 2017 г.''}, 17: {''author'': '' Доржи Далайцыренов '', ''text'': '' Игра виснет очень сильно уде нервы не выдерживают. День не возвращаю смысла нет кидать бабло просто так. Игра отстой '', ''date'': ''25 октября 2017 г.''}, 18: {''author'': '' Михаил Васильевич '', ''text'': '' просит регистрацию и также доступ к моим фотографиям, выйти из игры на начальном этапе не дает приходится принудительно закрывать игру, еще игра подтормаживает, на телефон не грешу, 4 оперативки и проц 625 '', ''date'': ''15 октября 2017 г.''}, 19: {''author'': '' Солёный Перчик '', ''text'': '' Отличное приложение "Вулкан казино"!  Мне очень понравилось это приложение т.к это Вулкан онлайн. Самый настоящий Вулкан '', ''date'': ''21 октября 2017 г.''}, 20: {''author'': '' Даша Трофимова '', ''text'': '' Отличное приложение Вулкан клуб. Казино вулкан даёт отличную возможность заработка средств и вывода выигрышей. Слоты - очень интересная тема! Игровые автоматы - лёгкий способ заработка. Всем советую. '', ''date'': ''20 октября 2017 г.''}, 21: {''author'': '' Екатерина Щур '', ''text'': '' Этот онлайн просто завораживает. Можно играть вечно и настроение только поднимается. А возможно что и взорвётся как вулкан. '', ''date'': ''27 октября 2017 г.''}, 22: {''author'': '' '', ''text'': '' Я раньше думал что это все ложь и вдруг мне друг сказал скачать вулкан онлайн ,и теперь я беру свои слова обратно ,вулкан казино 💪💪💪 '', ''date'': ''26 октября 2017 г.''}, 23: {''author'': '' Пётр Каркачёв '', ''text'': '' Лагает ужас играть не возможно. Хотя телефон у меня не слабый Lenovo s860 '', ''date'': ''17 октября 2017 г.''}, 24: {''author'': '' Дарья Засыпкина '', ''text'': '' Вулкан очень хорошее приложение.  Ну думала,  что подобных вулкан онлайн будет действовать и чтобы можно было выигравать.  Вулкан Казино помогло заработать 10000рубде '', ''date'': ''21 октября 2017 г.''}, 25: {''author'': '' Владимир Шкинёв '', ''text'': '' Удачное приложение. Для азартных ребят, а я именно такой. 😀 '', ''date'': ''26 октября 2017 г.''}, 26: {''author'': '' Собака Павлова '', ''text'': '' Заработай на рефералах , добавляй их, больше рефералов больше заработок, приложение New App, введи реф код Q71c9 и получи денежку в подарок. '', ''date'': ''16 октября 2017 г.''}, 27: {''author'': '' '', ''text'': '' Вулкан казино онлайн самая лучшая игра, заработала не мало денег с помощью этого приложения, большое спасибо, разработчикам '', ''date'': ''23 октября 2017 г.''}, 28: {''author'': '' Макаров Виктор '', ''text'': '' Вулкан топ казино, я закинул 100 рублей, поднял 100 млн $, пишу это сидя в бассейне на своей личной яхте, которая плавает рядом с Мальдивами, вулкан реально изменил мою жизнь!! '', ''date'': ''16 октября 2017 г.''}, 29: {''author'': '' Яна Воробьева '', ''text'': '' Вулкан казино очень хорошее приложение, вулкан - это то, что я искала. В игровых автоматах Вулкан - онлайн можно заработать деньги. '', ''date'': ''20 октября 2017 г.''}, 30: {''author'': '' Moldir Apbazbek '', ''text'': '' Это не клуб удачи а клуб лоходрончиков не лохуйтесь ребятаа проста одминестраторы бабки делают сидя лоходрон это '', ''date'': ''17 октября 2017 г.''}, 31: {''author'': '' D A R Y A '', ''text'': '' Вулкан Казино, почему у вас так много плагиатов? D: И ещё, почему вы назвали своё приложение "Вулкан"? Я играла в Вулкан Онлайн Приложение классное😄😂 '', ''date'': ''21 октября 2017 г.''}, 32: {''author'': '' Иван Темиров '', ''text'': '' Сплошной лохотрон  положил туда 200 рублей  и ни как не получается играть, игра виснет все тупит! Так что не советую '', ''date'': ''15 октября 2017 г.''}, 33: {''author'': '' '', ''text'': '' Отвратительное приложение,закинул денег на счет,играть на деньги не могу,только дэмо счет,вывести не могу,игры грузятся только с демо счетом,верните деньги!!! '', ''date'': ''18 октября 2017 г.''}, 34: {''author'': '' Ayumi Christel '', ''text'': '' Очень крутое приложение, ВУЛКАН ОНЛАЙН. ЗАРАБАТЫВАЮ РЕАЛЬНЫЕ ДЕНЬГИ.!!! '', ''date'': ''21 октября 2017 г.''}, 35: {''author'': '' Kate Taf '', ''text'': '' Вулкан - очень хорошее приложение. На нем реально заработать деньги. Казино вулкан- лучшее решение  если нужны  деньги. Советую всем скачивать Вулкан онлайн '', ''date'': ''25 октября 2017 г.''}, 36: {''author'': '' Андрей Цой '', ''text'': '' Клевое приложение Вулкан казино. Не раз поднимал нормальные суммы на Вулкан. Часто играю на Вулкан онлайн,теперь пришло время опробовать приложение '', ''date'': ''17 октября 2017 г.''}, 37: {''author'': '' alena Perevalova '', ''text'': '' Бонусные раунды, разнообразные сюжетные линии игровых автоматов вулкан, двойные выигрыши и призы! Великолепная возможность опробовать свою стратегию, набраться игрового опыта! '', ''date'': ''18 октября 2017 г.''}, 38: {''author'': '' Андрей Тарасов '', ''text'': '' Это даже смешно, казино полная хрень, все отзывы купленны, мне это напоминает концерт Петросяна '', ''date'': ''16 октября 2017 г.''}, 39: {''author'': '' Владислав Безносиков '', ''text'': '' Казино вулкан онлайн классная игра.  Сначала игра не пошла,  но потом стало везти и теперь оторваться не могу) '', ''date'': ''18 октября 2017 г.''}, 40: {''author'': " Olen''ka Klimova ", ''text'': '' Го*но приложение, всё виснет! И сам вулкан тоже го*но, хорошо что я не вкладываю туда деньги и вам не советую!! '', ''date'': ''21 октября 2017 г.''}, 41: {''author'': '' Данил Ночных '', ''text'': '' Казино вулкан хорошее приложение чтобы заработать денег не выходя их дома,у меня нету слов слоты вулкан это что то безупречное всем советую '', ''date'': ''14 октября 2017 г.''}, 42: {''author'': '' '', ''text'': '' Мне не понравилось.Графика просто класс!Но..... ЭТО ТВОРЕНИЕ ГОВОРИТ ЧТО Я НЕ ПРАВИЛЬНО ЗАРЕГАЛАСЬ!!! '', ''date'': ''24 октября 2017 г.''}, 43: {''author'': '' '', ''text'': '' Вулкан казино очень крут. Я очень люблю игровые автоматы и вулкан казино моё любимое приложение. '', ''date'': ''19 октября 2017 г.''}, 44: {''author'': '' Tvoya Illyuziya '', ''text'': '' Ребят,Вулкан это просто что-то с чем-то. Кажется,с Вулкан Казино я начинаю реально зарабатывать. Разработчики,огромное спасибо за замечательную работу. КАЗИНО ВУЛКАН КАЧАЙ НЕ ПОЖАЛЕЕШЬ '', ''date'': ''16 октября 2017 г.''}, 45: {''author'': '' Алла Максимова '', ''text'': '' Отличное приложение Вулкан, всем советую! Очень простое и удобное в использовании '', ''date'': ''18 октября 2017 г.''}}, ''description'': ''Самые популярные игровые автоматы на вашем телефоне или планшете совершенно бесплатно!\nБонусные раунды, разнообразные сюжетные линии игровых автоматов вулкан, двойные выигрыши и призы! Великолепная возможность опробовать свою стратегию, набраться игрового опыта!\nИспытайте радость от побед в Игровых Автоматах - Клуб удачи!\nОгромное количество людей уже играют с нами! Вы любите азарт и хотите постоянно выигрывать джекпоты? Наше казино «Игровые Автоматы Слоты Удачи» именно для вас! Окунитесь в атмосферу настоящего казино, круглосуточная доступность и поддержка игровых автоматов! Время за игрой пройдет незаметно, вы сможете отдохнуть и прекрасно провести время.\nГлавными плюсами к твоему состоянию станет:\n👍 Огромная поддержка бонусами на старте игры\n👍 Весомые бонусы на первый депозит\n👍 Фри спины\n👍 Круглосуточная помощь\nНаше казино онлайн уже зарекомендовало себя на российском рынке\nкак качественное и доступное развлечение для любителей слотов. Скачай виртуальное казино прямо сейчас. К слову, это займет всего несколько секунд. Наслаждайся игрой!'', ''top_developer'': False, ''updated'': ''9 октября 2017 г.'', ''reviews'': 3860, ''developer_id'': None, ''url'': ''https://play.google.com/store/apps/details?id=com.origgameclub.play'', ''interactive_elements'': [], ''current_version'': ''1.3'', ''free'': True, ''category'': [''GAME_CASINO'']}');
