INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('cherngame.slotesapp.com.slotland', 'ANDROID', '2017-12-12 03:00:36.233757', 'Игровые автоматы - клуб удачи', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=cherngame.slotesapp.com.slotland', 'https://lh3.googleusercontent.com/kMb6MlQgLWJYhLW1NoPgqgqD-Zf_eS5kLQjUoE12SbeH9sxEwx2DNfk6dadkLSVIqpA', '2017-12-16 01:30:43.931349','' , '{''developer_id'': None, ''icon'': ''https://lh3.googleusercontent.com/kMb6MlQgLWJYhLW1NoPgqgqD-Zf_eS5kLQjUoE12SbeH9sxEwx2DNfk6dadkLSVIqpA'', ''installs'': [1000, 5000], ''required_android_version'': ''4.2 или более поздняя'', ''score'': 4.951807022094727, ''editors_choice'': False, ''video'': None, ''interactive_elements'': [], ''updated'': ''22 ноября 2017 г.'', ''description'': ''Вулкан клуб — казино для всех возрастов\nНе хватает ярких эмоций? Хочется драйва, азарта и ярких впечатлений? Хочется поиграть в старые добрые игровые автоматы, а их нет под рукой? Казино Вулкан вам поможет! Заходите и начинайте играть! И молодежь, и люди старшего возраста с приходом интернета оценили, как здорово, когда под рукой есть вулкан слоты и вулкан автоматы.\nНи умопомрачительных очередей, ни споров, ни недопонимания: у каждого на смартфоне теперь есть свой собственный Вулкан клуб. Как же приятно носить портативное казино в кармане и наслаждаться игрой каждый день там, где удобно! Можно и на работе, когда выдастся свободная минутка. Думается, даже начальник за такое не пожурит и даже сам ловко и увлеченно начнет играть в виртуальные игровые автоматы в казино Вулкан!\nСовременная молодежь, так избалованная гаджетами, игрушками и графикой, и то с огромным удовольствием осваивает игры, которые так нравились их родителям. В любом советском баре, на вокзалах и в общественных местах стояли игровые автоматы! Радость и кайф от игры испытывал каждый, даже не самый азартный человек!\nЛичное казино Вулкан в твоем кармане\nСмартфоны изменили мир! Каждый день миллионы людей качают вулкан слоты и выбирают вулкан автоматы, чтобы отвлечься в очереди, получить удовольствие, скоротать время в метро или автобусе. Томительно ожидание с казино Вулкан становится увлекательным времяпрепровождением, которое помогает испытать удачу!\nКазино Вулкан — это современное воплощение «одноруких бандитов», но честное, продуманное и невероятно удобное. Развитие гэмблинг индустрии позволило создать устройства простые, притягательные и будоражащие воображение! Выстраивайте свои системы, играйте с умом, наблюдайте за закономерностями — это же так увлекательно.\nСлоты вулкан можно активировать прямо сейчас и создать свой собственный алгоритм выигрышей и не проигрывать вовсе. Игровые автоматы, как и любое другое сложное программное обеспечение, имеет свои особенности и свои алгоритмы. Достаточно распознать, натренироваться, а затем прямиком направляться в реальные казино, чтобы испытать удачу.\nАдреналиновые эмоции от игры в казино\nСовсем не важно, в какие игры предпочитает играть человек! Он жаждет всплеска адреналина. И когда все городские казино оказались за городскими чертами, на выручку пришли практичные, удобные и атмосферные вулкан автоматы. Это же так просто: открыть смартфон, запустить казино Вулкан, и можно наслаждаться игрой хоть круглый сутки. Ну, или до тех пор, пока не закончится заряд батареи!\nОткройте прямо сейчас целую вселенную развлечений, найдите свой игровой автомат, тот, что придется вам по душе больше других. Играйте, развлекайтесь, радуйтесь и побеждайтесь, а мы будем следить за тем, чтобы у вас все получилось!\nВам понравится наш Вулкан клуб! Ведь он вызывает у посетителей взрыв эмоций и всплеск адреналина. Он скрасит будни и подарит новые ощущения. Талантливые игроманы начинают свою карьеру здесь — на игровых автоматах казино Вулкан!'', ''title'': ''Игровые автоматы - клуб удачи'', ''developer_url'': None, ''free'': True, ''developer_address'': None, ''url'': ''https://play.google.com/store/apps/details?id=cherngame.slotesapp.com.slotland'', ''current_version'': ''1.0'', ''size'': None, ''ratings'': {1: 1, 2: 1, 3: 1, 4: 1, 5: 1}, ''top_developer'': False, ''recent_changes'': '''', ''app_id'': ''cherngame.slotesapp.com.slotland'', ''iap'': False, ''developer'': ''Aftone Hansole'', ''reviews'': 83, ''content_rating'': ''12+'', ''price'': ''0'', ''category'': [''GAME_CASINO''], ''reviews_text'': {0: {''author'': '' Хамчиев Белан '', ''date'': '''', ''text'': '' Обожаю это приложение.Игровые автоматы вулкан помогли мне подзаработать.Всем советую. ''}, 1: {''author'': '' Неизвестный Руфер '', ''date'': '''', ''text'': '' Казино вулкан поможет скоротать время и Ещё скоротать время ''}, 2: {''author'': '' '', ''date'': '''', ''text'': '' Вулкан просит чтоб в рекламе было слово вулкан) ''}, 3: {''author'': '' Artem Zhuravlev '', ''date'': '''', ''text'': '' Лучшее казино вулкан в которое я только играл!!! ''}, 4: {''author'': '' Вадим котофеевичь. yong '', ''date'': '''', ''text'': '' Вулкан это хорошее казино, вулкан топ, в вулкане можно хорошо заработать ''}, 5: {''author'': '' ToWWyMAN '', ''date'': '''', ''text'': '' Вулкан топ Поднял деньжат ''}, 6: {''author'': '' Хамчиев Белан '', ''date'': ''11 декабря 2017 г.'', ''text'': '' Обожаю это приложение.Игровые автоматы вулкан помогли мне подзаработать.Всем советую. ''}, 7: {''author'': '' Неизвестный Руфер '', ''date'': ''10 декабря 2017 г.'', ''text'': '' Казино вулкан поможет скоротать время и Ещё скоротать время ''}, 8: {''author'': '' '', ''date'': ''11 декабря 2017 г.'', ''text'': '' Вулкан просит чтоб в рекламе было слово вулкан) ''}, 9: {''author'': '' Artem Zhuravlev '', ''date'': ''11 декабря 2017 г.'', ''text'': '' Лучшее казино вулкан в которое я только играл!!! ''}, 10: {''author'': '' Вадим котофеевичь. yong '', ''date'': ''10 декабря 2017 г.'', ''text'': '' Вулкан это хорошее казино, вулкан топ, в вулкане можно хорошо заработать ''}, 11: {''author'': '' ToWWyMAN '', ''date'': ''8