 у тебя в кармане!<br/><br/>Казино короля Франка ждет своего героя! Испытай свою удачу вместе с нашими игровыми автоматами.<br/>Поймай заветные «три топора», сорви джекпот и забери свой куш уже сегодня. Всё, что нужно для игры онлайн — твой смартфон и интернет. <br/>Хоть ты и будешь играть в казино по сети, ты сможешь испытать такие же эмоции, как будто сидишь за столом с рулеткой с настоящим крупье. Звон игровых автоматов будет раздаваться у тебя в ушах даже после того, как ты спрячешь свой смартфон в карман, а однорукие бандиты будут тебе сниться еще очень долго.<br/>Правила игры довольно просты: нужно поймать выигрышную комбинацию на одном из 777 игровых слотов. Это не так просто, как кажется. Но гораздо легче, чем сражаться с варварами, жаждущими забрать казино короля себе. Каждый выигрыш будет приближать тебя к большой победе в битве за будущее нашего казино. Помогай!<br/>Играть в казино можно только онлайн: мы регулярно обновляем статистику, следим за игрой и улучшаем наши игровые автоматы. Все игровые слоты обладают приятным интерфейсом, красивой графикой и удобным управлением. Разберутся даже обезьянки:)<br/>Протестировать наше казино ты сможешь без регистрации и абсолютно бесплатно. Мы подарим тебе солидный депозит и приветственный бонус, который ты сможешь потратить на наших игровых автоматах. Надеемся, ты останешься доволен нашими слотами.<br/>Особенности нашего онлайн казино:<br/>— Ощущение реальной игры. Как будто сидишь в настоящем казино!<br/>— Честные алгоритмы наших игровых автоматов исключают обман и подтасовку<br/>— Быстрый спин и автоматическая остановка<br/>— Всеми любимые игры как Обезьянки, Книга РА и Фрукты<br/>— Получи бонус за каждое 777 вращение!<br/>— Воспользуйся промокодом «Франк» и получи 100 бонусных спинов на слотах<br/>— Эксклюзивный доступ, позволяющий получить до 200% бонусов!<br/>— Приятная графика и хорошее звуковое оформление, передающее дух настоящих казино <br/>Играй в казино онлайн с друзьями!<br/><br/>— Стань частью нашего казино и зарабатывай бесплатные монеты!<br/>— Интеграция с соцсетями позволит быстро найти друзей, которые уже выигрывают вместе с нами<br/>— Бонусы за каждого привлеченного друга<br/>Вы можете быть уверены в качестве и надежности наших игровых автоматов. Вперед на поиски сокровищ!<br/>Наше казино предназначена только для взрослых. В игре нельзя играть на настоящие деньги, и в ней нельзя выиграть реальные деньги или призы. Играя в виртуальные азартные игры, вы не сможете гарантировать себе успех в реальных казино. <br/><br/>Ознакомьтесь с нашими условиями (http://telegra.ph/Privacy-Policy-of-Castle--kazino-onlajn-01-23) и политикой конфиденциальности (http://telegra.ph/Privacy-Policy-of-Castle--kazino-onlajn-01-23). При возникновении сложностей пишите.'', ''developer_address'': None, ''free'': True, ''reviews_text'': {0: {''text'': '' Казино Вулкан - это отличное приложение. Недавно сорвал на автоматах Джекпот, был очень рад!)  Игровые автоматы больше всего вызывают азарт, поэтому они мне и нравятся. Геймплей хорош. '', ''date'': '''', ''author'': '' ''}, 1: {''text'': '' Отличное приложение от Казино Вулкан. Очень удобный геймплей, все понятно и просто. Особенно понравился большой Джекпот, надо стремиться сорвать его. Игровые автоматы выполнены очень качественно. Разработчики сразу видно, что постарались, создавая графику автоматов. '', ''date'': '''', ''author'': '' Владимир Толмачев ''}, 2: {''text'': '' Игровые автоматы мне очень понравились.  Вулкан действительно умеет делать приложения!  В Казино вулкан я регулярно срываю джекпот и это  круто!  В общем автоматы мне безумно понравились.  Я доволен! '', ''date'': '''', ''author'': '' ''}, 3: {''text'': '' Понравилось приложения Казино Вулкан, сейчас мало где найдешь автоматы в которых выиграть реально. Деньги выводят быстро, по работе приложения все четко, хоть и смартфон не мощный, тянет без проблем. '', ''date'': '''', ''author'': '' Валерий Чернявский ''}, 4: {''text'': '' Я только и играю в казино вулкан,  где много интересных игровых автоматов и главное, что есть стимул выиграть джекпот)) Получается здесь зарабатывать довольно не плохие деньги. '', ''date'': '''', ''author'': '' Еlena Tkachenko ''}, 5: {''text'': '' Хоть я и небольшой поклонник казино, но приложение казино онлайн перевернуло мой мир. Никогда не думал, что обычное приложение казино игровые автоматы даст возможность легко так зарабатывать. Скорее бы обнову для казино 777! '', ''date'': '''', ''author'': '' Евгений ''}, 6: {''text'': '' Казино Вулкан - это отличное приложение. Недавно сорвал на автоматах Джекпот, был очень рад!)  Игровые автоматы больше всего вызывают азарт, поэтому они мне и нравятся. Геймплей хорош. '', ''date'': ''26 января 2018 г.'', ''author'': '' ''}, 7: {''text'': '' Отличное приложение от Казино Вулкан. Очень удобный геймплей, все понятно и просто. Особенно понравился большой Джекпот, надо стремиться сорвать его. Игровые автоматы выполнены очень качественно. Разработчики сразу видно, что постарались, создавая графику автоматов. '', ''date'': ''26 января 2018 г.'', ''author'': '' Владимир Толмачев ''}, 8: {''text'': '' Игровые автоматы мне очень понравились.  Вулкан действительно умеет делать приложения!  В Казино вулкан я регулярно срываю джекпот и это  круто!  В общем автоматы мне безумно понравились.  Я доволен! '', ''date'': ''26 января 2018 г.'', ''author'': '' ''}, 9: {''text'': '' Понравилось приложения Казино Вулкан, сейчас мало где найдешь автоматы в которых выиграть реально. Деньги выводят быстро, по работе приложения все четко, хоть и смартфон не мощный, тянет без проблем. '', ''date'': ''26 января 2018 г.'', ''author'': '' Валерий Чернявский ''}, 10: {''text'': '' Я только и играю в казино вулкан,  где много интересных игровых автоматов и главное, что есть стимул выиграть джекпот)) Получается здесь зарабатывать довольно не плохие деньги. '', ''date'': ''26 января 2018 г.'', ''author'': '' Еlena Tkachenko ''}, 11: {''text'': '' Хоть я и небольшой поклонник казино, но приложение казино онлайн перевернуло мой мир. Никогда не думал, что обычное приложение казино игровые автоматы даст возможность легко так зарабатывать. Скорее бы обнову для казино 777! '', ''date'': ''28 января 2018 г.'', ''author'': '' Евгений ''}, 12: {''text'': '' Отличное приложение , давно хотел иметь у себя казино онлайн. '', ''date'': ''28 января 2018 г.'', ''author'': '' Adriatika ''}, 13: {''text'': '' Казино онлайн очень понравилось. Большой выбор игровых автоматов, которые вызывают невероятный азарт. Приложение работает отлично, жалоб нет. Недавно выиграл джекпот) Везёт мне) '', ''date'': ''28 января 2018 г.'', ''author'': '' ''}, 14: {''text'': '' Давно искал приложение похожее на игровые автоматы Вулкан, вот как раз таки и нашел.Казино вулкан мне очень нравилось, а это приложение лучше, здесь автоматы интереснее, джекпот бывает чаще. '', ''date'': ''26 января 2018 г.'', ''author'': '' ''}, 15: {''text'': '' Просто отличное онлайн казино! Все очень понравилось, достаточно удобное !советую!!5баллов '', ''date'': ''28 января 2018 г.'', ''author'': '' Наталья Александровна ''}, 16: {''text'': '' Тестирую приложение пару дней, игровые автоматы мне понравились, я думаю приложение оценят все любители казино вулкан, в каких-то моментах эти автоматы даже лучше, чем вулкан. Хорошие привилегии для новичков, джекпот еще не сорвал, но жду и надеюсь. '', ''date'': ''26 января 2018 г.'', ''author'': '' Егор Занин ''}, 17: {''text'': '' Отличные игровые автоматы онлайн. Я азартный человек, и люблю играть в казино. Геймплей хорош собой, разнообразие слотов. Играю каждый день.  В общем все отлично, ставлю твердую 5. '', ''date'': ''28 января 2018 г.'', ''author'': '' Natali Zavalskaya ''}, 18: {''text'': '' Приложение отличное, всегда род боком теперь казино онлайн, можно играть в любое время, очень удобный интерфейс и просто все понять. Выигрыши реальные. Мне понравилось приложение. '', ''date'': ''28 января 2018 г.'', ''author'': '' Mark Ok ''}, 19: {''text'': '' Приложение казино игровые автоматы достаточно интересное и увлекательное. Играть одно удовольствие. Сижу в нем теперь постоянно. Очень нравится. Рекомендую. '', ''date'': ''28 января 2018 г.'', ''author'': '' Руслан Кузнецов ''}, 20: {''text'': '' Скачиваю игровые автоматы регулярно, ищу свое приложение, в котором бы все устроило, как в казино вулкан. И вот, кажется, нашел, здесь разнообразные автоматы, хорошие бонусы, есть депозит для новичков, в общем все, чтобы сорвать джекпот, даже вулкан отдыхает '', ''date'': ''26 января 2018 г.'', ''author'': '' Андрей Титов ''}, 21: {''text'': '' Скачал недавно это казино онлайн. Поначалу не верил, что тут можно деньги выйграть, но вот только что вывел выйгрыш себе на счет и на радостях решил написать отзыв) Отличная игруха, ставлю 5 звезд!!! '', ''date'': ''28 января 2018 г.'', ''author'': '' ''}, 22: {''text'': '' Казино игровые автоматы лучшее развлечение, приятно посидеть и поиграть вечером, приложение очень простое и  удобное, я довольна что скачала его. Большое спасибо разработчикам. '', ''date'': ''28 января 2018 г.'', ''author'': '' Maria A ''}, 23: {''text'': '' Самое лучшее казино! Я пробовал много казино онлайн, это оказался самым оптимальным. Рекомендую скачать казино 777, если у вас есть свободное время! Казино игровые автоматы работают '', ''date'': ''28 января 2018 г.'', ''author'': '' ''}, 24: {''text'': '' Давно искал хорошее казино онлайн и наконец-то нашел это приложение! Отличное казино, все честно, выйгрыш уже выводил себе на карту) интересные игровые автоматы. Всем рекомендую! '', ''date'': ''28 января 2018 г.'', ''author'': '' ''}, 25: {''text'': '' Казизо лучшие игровые автоматы '', ''date'': ''28 января 2018 г.'', ''author'': '' ''}}, ''description'': ''Крутые игровые автоматы у тебя в кармане!\nКазино короля Франка ждет своего героя! Испытай свою удачу вместе с нашими игровыми автоматами.\nПоймай заветные «три топора», сорви джекпот и забери свой куш уже сегодня. Всё, что нужно для игры онлайн — твой смартфон и интернет.\nХоть ты и будешь играть в казино по сети, ты сможешь испытать такие же эмоции, как будто сидишь за столом с рулеткой с настоящим крупье. Звон игровых автоматов будет раздаваться у тебя в ушах даже после того, как ты спрячешь свой смартфон в карман, а однорукие бандиты будут тебе сниться еще очень долго.\nПравила игры довольно просты: нужно поймать выигрышную комбинацию на одном из 777 игровых слотов. Это не так просто, как кажется. Но гораздо легче, чем сражаться с варварами, жаждущими забрать казино короля себе. Каждый выигрыш будет приближать тебя к большой победе в битве за будущее нашего казино. Помогай!\nИграть в казино можно только онлайн: мы регулярно обновляем статистику, следим за игрой и улучшаем наши игровые автоматы. Все игровые слоты обладают приятным интерфейсом, красивой графикой и удобным управлением. Разберутся даже обезьянки:)\nПротестировать наше казино ты сможешь без регистрации и абсолютно бесплатно. Мы подарим тебе солидный депозит и приветственный бонус, который ты сможешь потратить на наших игровых автоматах. Надеемся, ты останешься доволен нашими слотами.\nОсобенности нашего онлайн казино:\n— Ощущение реальной игры. Как будто сидишь в настоящем казино!\n— Честные алгоритмы наших игровых автоматов исключают обман и подтасовку\n— Быстрый спин и автоматическая остановка\n— Всеми любимые игры как Обезьянки, Книга РА и Фрукты\n— Получи бонус за каждое 777 вращение!\n— Воспользуйся промокодом «Франк» и получи 100 бонусных спинов на слотах\n— Эксклюзивный доступ, позволяющий получить до 200% бонусов!\n— Приятная графика и хорошее звуковое оформление, передающее дух настоящих казино\nИграй в казино онлайн с друзьями!\n— Стань частью нашего казино и зарабатывай бесплатные монеты!\n— Интеграция с соцсетями позволит быстро найти друзей, которые уже выигрывают вместе с нами\n— Бонусы за каждого привлеченного друга\nВы можете быть уверены в качестве и надежности наших игровых автоматов. Вперед на поиски сокровищ!\nНаше казино предназначена только для взрослых. В игре нельзя играть на настоящие деньги, и в ней нельзя выиграть реальные деньги или призы. Играя в виртуальные азартные игры, вы не сможете гарантировать себе успех в реальных казино.\nОзнакомьтесь с нашими условиями (http://telegra.ph/Privacy-Policy-of-Castle--kazino-onlajn-01-23) и политикой конфиденциальности (http://telegra.ph/Privacy-Policy-of-Castle--kazino-onlajn-01-23). При возникновении сложностей пишите.'', ''thumbnails'': [''https://lh3.googleusercontent.com/bZTvpjxg65Yt4qPvOD-4EmezNZveJwV_cq-0QQ5f3CA_xiMzxtYNMWAGBEN7CC8bkTQ=h310'', ''https://lh3.googleusercontent.com/NOzQgOmGmzSr9JVGP8zEZ5YzL8H3oGoGl4WYw5KV4HYXPvph1VFnK_HD4R14xws3LQ=h310'', ''https://lh3.googleusercontent.com/FCBiOBDXGVG8HA-pdZr7fnLU0jhPYmc-nIP_bihNURdePzyOJRSguCnkIx8Ebls4zb1C=h310'', ''https://lh3.googleusercontent.com/xVnJpFACmlZONxyXX1xR3tQJfmq4PTH4zZNVCtDwDLhCmDf3LXMod_Xz2nfh3rO-awyT=h310'', ''https://lh3.googleusercontent.com/Rke5A8t9c-qlwW4MV7TjdBwf-s7gUDpIqVjaiZdkjKT1TmBgCw5NJ9b9z6DCuHlE6_Q=h310''], ''updated'': ''23 января 2018 г.'', ''iap'': False}');
