INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.katerina.ny_slots', 'ANDROID', '2017-12-28 03:00:17.352456', 'Новогодние Слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.katerina.ny_slots', 'https://lh3.googleusercontent.com/p4Df9V3Y3K_QUG89B2FeL5QP4K932w4FLctaq_6sQaaKYrFhdrDRAU221h28nZ7ApA', '2018-01-24 02:00:34.085647','' , '{''top_developer'': False, ''developer'': ''Екатерина Гайковская'', ''thumbnails'': [''https://lh3.googleusercontent.com/I7KTOG4CFiuagtmvF2STZNg83vzM0-fHWXHFGXQihV9jjfeeCXCxOpcW8jEukafBIF0=h310'', ''https://lh3.googleusercontent.com/AElLemj_P0Wo5H6mOnAizLHgy_2upew-YYNQD0ewLM3dsZ3ZRHP_CmyRpHKIIP_axQ=h310'', ''https://lh3.googleusercontent.com/3kiiOaHVPtXegwUaQAN-KAPLJMRnuINQc2LWTqdXtVx47pVme3YYJOUKaflzIVctHblA=h310''], ''video'': None, ''updated'': ''19 декабря 2017 г.'', ''icon'': ''https://lh3.googleusercontent.com/p4Df9V3Y3K_QUG89B2FeL5QP4K932w4FLctaq_6sQaaKYrFhdrDRAU221h28nZ7ApA'', ''required_android_version'': ''4.3 или более поздняя'', ''ratings'': {1: 1, 2: 1, 3: 1, 4: 1, 5: 1}, ''content_rating'': ''12+'', ''app_id'': ''com.katerina.ny_slots'', ''developer_email'': ''gaykateri@gmail.com'', ''developer_url'': ''https://pastebin.com/tAMVtNYy'', ''price'': ''0'', ''developer_address'': None, ''interactive_elements'': [], ''category'': [''GAME_CASINO''], ''description'': ''С удовольствием представляем новую игру с блестящей новогодней тематикой! Мы готовы тебя побаловать изобилием праздничных предложений и засыпать изумительными бонусами.  Cейчас самое чудесное время для исполнения желаний и особенных побед.\nНовогодние Слоты уже приглянулись многим опытным пользователям за простоё использование, впечатляющий игровой опыт  и  атмосферу настоящих чудес. Поторопись установить приложение, чтобы зарядиться эмоциями и обрести головокружительный успех.\nТебя ждут :\n⭐️ Новогодние бонусы и акции для самых азартных игроков;\n⭐️ Множество фриспинов;\n⭐️ Мега – крутая графика;\n⭐️ Бонусы на первый депозит;\n⭐️ Приветственные бонусы;\n⭐️ Быстрый вывод средств;\n⭐️ Большие денежные награды.\nУстанавливай приложение прямо сейчас, не выходя из дома! Скорее вращай и побеждай !'', ''reviews_text'': {0: {''author'': '' Лидия Монахина '', ''text'': '' Люблю играть в слоты, поэтому и скачала приложение "Новогодние слоты", как нельзя актуальна на пороге ведь новый год. Нашла там слоты новогодней тематике, многие из них раньше даже не видела. Мне понравились. '', ''date'': ''''}, 1: {''author'': '' '', ''text'': '' Выигрыши в приложении новогодние слоты вулкан - обычное дело. Нет, конечно это приложение не заменит работу, но получить дополнительный доход, причем весьма немаленький, вполне реально. '', ''date'': ''''}, 2: {''author'': '' Николай Тимофеев '', ''text'': '' Накануне праздника решил скачать что-то подобное, а то глазу примелькались уже обычные слоты. Да и в честь нового года намного лучше условия игры, проверил на себе, выйграл больше, чем обычно! '', ''date'': ''''}, 3: {''author'': '' Лидия Монахина '', ''text'': '' Люблю играть в слоты, поэтому и скачала приложение "Новогодние слоты", как нельзя актуальна на пороге ведь новый год. Нашла там слоты новогодней тематике, многие из них раньше даже не видела. Мне понравились. '', ''date'': ''27 декабря 2017 г.''}, 4: {''author'': '' '', ''text'': '' Выигрыши в приложении новогодние слоты вулкан - обычное дело. Нет, конечно это приложение не заменит работу, но получить дополнительный доход, причем весьма немаленький, вполне реально. '', ''date'': ''27 декабря 2017 г.''}, 5: {''author'': '' Николай Тимофеев '', ''text'': '' Накануне праздника решил скачать что-то подобное, а то глазу примелькались уже обычные слоты. Да и в честь нового года намного лучше условия игры, проверил на себе, выйграл больше, чем обычно! '', ''date'': ''27 декабря 2017 г.''}}, ''iap_range'': None, ''recent_changes'': '''', ''score'': 4.636363506317139, ''screenshots'': [''https://lh3.googleusercontent.com/I7KTOG4CFiuagtmvF2STZNg83vzM0-fHWXHFGXQihV9jjfeeCXCxOpcW8jEukafBIF0=h900'', ''https://lh3.googleusercontent.com/AElLemj_P0Wo5H6mOnAizLHgy_2upew-YYNQD0ewLM3dsZ3ZRHP_CmyRpHKIIP_axQ=h900'', ''https://lh3.googleusercontent.com/3kiiOaHVPtXegwUaQAN-KAPLJMRnuINQc2LWTqdXtVx47pVme3YYJOUKaflzIVctHblA=h900''], ''developer_id'': None, ''description_html'': ''С удовольствием представляем новую игру с блестящей новогодней тематикой! Мы готовы тебя побаловать изобилием праздничных предложений и засыпать изумительными бонусами.  Cейчас самое чудесное время для исполнения желаний и особенных побед. <br/>Новогодние Слоты уже приглянулись многим опытным пользователям за простоё использование, впечатляющий игровой опыт  и  атмосферу настоящих чудес. Поторопись установить приложение, чтобы зарядиться эмоциями и обрести головокружительный успех.<br/><br/>Тебя ждут :<br/>⭐️ Новогодние бонусы и акции для самых азартных игроков;<br/>⭐️ Множество фриспинов;<br/>⭐️ Мега – крутая графика;<br/>⭐️ Бонусы на первый депозит;<br/>⭐️ Приветственные бонусы;<br/>⭐️ Быстрый вывод средств;<br/>⭐️ Большие денежные награды.<br/>Устанавливай приложение прямо сейчас, не выходя из дома! Скорее вращай и побеждай !'', ''iap'': False, ''title'': ''Новогодние Слоты'', ''editors_choice'': False, ''free'': True, ''current_version'': ''6.18'', ''reviews'': 11, ''url'': ''https://play.google.com/store/apps/details?id=com.katerina.ny_slots'', ''size'': None, ''installs'': [500, 1000]}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('our.sl.ots', 'ANDROID', '2018-01-30 03:03:52.290781', 'Ваши Слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=our.sl.ots', 'https://lh3.googleusercontent.com/YTGsYRa_W14jyhMRjKri5gUL8WtcvkpQ1vWRDEwodABavYQEUQ2pXmmqJQflQrRQ0A', '2018-02-13 19:30:27.858063','' , '{''description_html'': ''Представляем вашему вниманию лучший онлайн портал игровых автоматов - казино вулкан. Популярность Вулкан автоматы обрели, в первую очередь, благодаря огромному набору слотов онлайн. В каталоге более 200 моделей, и все они являются продукцией от ведущих в мире создателей. В клубе Вулкан игровые автоматы разнообразные по содержанию, но, так или иначе, представляют приключенческий жанр, что позволяет игроку с максимальным комфортом провести время. Вулкан клуб предлагает не только огромнейший ассортимент игровых аппаратов, но и привлекательный дизайн, легкое, понятное на интуитивном уровне управление и несложные правила игры.'', ''current_version'': ''1.2.1'', ''iap_range'': None, ''thumbnails'': [''https://lh3.googleusercontent.com/q2PX65yz3LVU9LiOmHkjD7n6i-7Piz5IvEYDy-tdBuPGUNDWqgxEzCg-TtgS2c0Xdyus=h310'', ''https://lh3.googleusercontent.com/nkIbJ2jncF2Y_5xy2ZroIqSKej-fKY7KoxmBJbCsxamuIH4U9PBi56UzczsmpnyDxd8=h310'', ''https://lh3.googleusercontent.com/QykQKd4imEwvQ5Gmnvvl4bZ4eXoqjtkkdnW12jhpLOIZajtzjbyXiZ0gfVzkL4Xj1qA=h310''], ''installs'': [10, 50], ''score'': 4.5714287757873535, ''developer'': ''Инесса Низовская'', ''title'': ''Ваши Слоты'', ''interactive_elements'': [], ''iap'': False, ''screenshots'': [''https://lh3.googleusercontent.com/q2PX65yz3LVU9LiOmHkjD7n6i-7Piz5IvEYDy-tdBuPGUNDWqgxEzCg-TtgS2c0Xdyus=h900'', ''https://lh3.googleusercontent.com/nkIbJ2jncF2Y_5xy2ZroIqSKej-fKY7KoxmBJbCsxamuIH4U9PBi56UzczsmpnyDxd8=h900'', ''https://lh3.googleusercontent.com/QykQKd4imEwvQ5Gmnvvl4bZ4eXoqjtkkdnW12jhpLOIZajtzjbyXiZ0gfVzkL4Xj1qA=h900