рвать большой куш! '', ''date'': ''26 декабря 2017 г.''}, 10: {''author'': '' Евгений Чемезов '', ''text'': '' казино вулкан это для тех кто хочет реально заработать удачи всем в казино вулкан '', ''date'': ''26 декабря 2017 г.''}, 11: {''author'': '' Александр Шиндилюк '', ''text'': '' Вулкан казино супер '', ''date'': ''26 декабря 2017 г.''}}, ''video'': None, ''current_version'': ''1.0'', ''icon'': ''https://lh3.googleusercontent.com/JX6Yf1DZvgLCJoymPnQ-gZpuI1zWg6r_beKS_s1O24142akK8uuyf3phao5ZWeryew'', ''content_rating'': ''12+'', ''developer_address'': None, ''size'': None, ''title'': ''Слоты игровые автоматы онлайн'', ''interactive_elements'': [], ''developer_id'': None, ''screenshots'': [''https://lh3.googleusercontent.com/Rmj1Gfifk4bBDG9Mu3jHhhV8MJlVJ5Le3i2mTzMdhrkGyyfxGcgO23gFmjBEQvSZFQ=h900'', ''https://lh3.googleusercontent.com/SsRoLgoGiEVj-QtZNIQBTFh3ZpelW7z0OI6Re7StwROOLcvIXtRLbhwBsZGyQJrGDw=h900'', ''https://lh3.googleusercontent.com/AcuhTQ_WruRd1EqfxBX6bJz-RWSROeYUi84RPDO62mUEwsJ9g7El7YXOMmnr0eTFfvE=h900'', ''https://lh3.googleusercontent.com/mntGnf5gBKRuJRXGCydDGjgTwgSqvoa3KZB1Qz3U5Qjie-iJnqHgnfaEb4tdBdtFubY=h900''], ''recent_changes'': '''', ''thumbnails'': [''https://lh3.googleusercontent.com/Rmj1Gfifk4bBDG9Mu3jHhhV8MJlVJ5Le3i2mTzMdhrkGyyfxGcgO23gFmjBEQvSZFQ=h310'', ''https://lh3.googleusercontent.com/SsRoLgoGiEVj-QtZNIQBTFh3ZpelW7z0OI6Re7StwROOLcvIXtRLbhwBsZGyQJrGDw=h310'', ''https://lh3.googleusercontent.com/AcuhTQ_WruRd1EqfxBX6bJz-RWSROeYUi84RPDO62mUEwsJ9g7El7YXOMmnr0eTFfvE=h310'', ''https://lh3.googleusercontent.com/mntGnf5gBKRuJRXGCydDGjgTwgSqvoa3KZB1Qz3U5Qjie-iJnqHgnfaEb4tdBdtFubY=h310''], ''description'': ''В нашем приложении Вулкан Казино собрана одна из самых крупных коллекций слотов и игровых автоматов.\nСледуй за своей мечтой в мир приключений и азарта, которые предлагают игровые автоматы и азартные игры.\nВ нашем казино Вы можете сорвать куш, настоящий Джекпот, или просто поиграть в своё удовольствие.\nЗдесь есть всё!\n★ Особенности приложения ★\n★\nКачественные аппараты казино\nКачественная графика, отлично порисованные детали, современный и удобный геймплей,       быстрая скорость отклика и многое другое.\n★\nИгроки онлайн\nБольшое сообщество любителей казино вулкан онлайн – играйте, общайтесь, соревнуйтесь. Всё это теперь в одном приложении.\n★\nБонусные игры\nИграйте и открывайте новые бонусные игры, которые подарят Вам массу бонусов и выигрышей в аппаратах.\n★\nБолее 100 слотов\nТеперь в одном месте Вы можете найти все любимые и популярные слоты. Просто выбирайте и вперед к выигрышам!\nСорвите Джекпот прямо с Вашего мобильника! Теперь не нужно ехать в Лас Вегас или идти в оригинальное казино. Теперь достаточно скачать приложение на Ваш телефон и наслаждаться реалистичными игровыми аппаратами Вулкан!'', ''required_android_version'': ''4.0.3 или более поздняя'', ''url'': ''https://play.google.com/store/apps/details?id=cas.apps.vulo'', ''installs'': [500, 1000], ''top_developer'': False, ''category'': [''GAME_CASINO''], ''description_html'': ''<b>В нашем приложении Вулкан Казино собрана одна из самых крупных коллекций слотов и игровых автоматов.</b> Следуй за своей мечтой в мир приключений и азарта, которые предлагают игровые автоматы и азартные игры.<b>В нашем казино Вы можете сорвать куш, настоящий Джекпот, или просто поиграть в своё удовольствие.</b> Здесь есть всё!<br/><br/>★ Особенности приложения ★<br/>★<b>Качественные аппараты казино</b> <br/>Качественная графика, отлично порисованные детали, современный и удобный геймплей,       быстрая скорость отклика и многое другое.<br/>★<b>Игроки онлайн</b><br/>Большое сообщество любителей казино вулкан онлайн – играйте, общайтесь, соревнуйтесь. Всё это теперь в одном приложении.<br/>★<b>Бонусные игры</b><br/>Играйте и открывайте новые бонусные игры, которые подарят Вам массу бонусов и выигрышей в аппаратах.<br/>★<b>Более 100 слотов</b><br/>Теперь в одном месте Вы можете найти все любимые и популярные слоты. Просто выбирайте и вперед к выигрышам!<br/