INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('app.dinser.slots', 'ANDROID', '2017-12-29 03:01:44.410302', 'Клуб - игровые автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=app.dinser.slots', 'https://lh3.googleusercontent.com/x7oqBdYf2buxicj-t9ffHwyKiB6lQdBm-NwLuw3_gFeHnueK7SEBk39O8DeKyEfCMotf', '2018-01-03 16:30:33.478922','' , '{''developer_address'': None, ''category'': [''GAME_CASINO''], ''url'': ''https://play.google.com/store/apps/details?id=app.dinser.slots'', ''iap_range'': None, ''reviews'': 3, ''recent_changes'': '''', ''description_html'': ''Чем занять себе в серый рабочий период? Будто вздохнуть не выходя из дома? Лучше только пригодится доступ в вулкан клуб. Сфера увлекающихся игр и слоты привлекает всякого, так как играть и одолевать – будто имеет возможность ощутить превосходство? В данном круге имеется собственные устав, собственная деяния, собственные тайны.<br/><br/>Правдивая забава, достойные внимания вулкан игровые автоматы онлайн, а этак ведь забавы с настоящими конкурентами – безвыездно наверное устроило игровые клубы. Хоть кто грезил содрать джекпот вулкан клуб, и в данной теме возникло очень много суеверий.<br/><br/>В вулкан клуб постоянно проводилась чисто, эффективность автоматов на высоком уровне. Игровые автоматы онлайн данного постоянно имелись глубоки народу. В наши жизнь главная забава передалась в веб. Линия вулкан клуб еще перебралось в интернет. Говорят специалисты, преимущество в данном случае еще больше!'', ''reviews_text'': {0: {''author'': '' Vladimir Shevchik '', ''date'': '''', ''text'': '' Классное казино. Играть тут одно удовольствие. Игр очень много, есть из чего выбрать. Классно всё. ''}, 1: {''author'': '' '', ''date'': '''', ''text'': '' Супер клуб,в котором можно ощутить атмосферу казино,постоянно здесь играю и вывел не мало монет,спасибо ''}, 2: {''author'': '' Флинтхарт Гломгольд '', ''date'': '''', ''text'