INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('talebllloyd.vadreeflioper.vaxziizioler.cxadeerfooo', 'ANDROID', '2017-12-23 03:01:30.358850', 'Слоты удачи - Игровые автоматы', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=talebllloyd.vadreeflioper.vaxziizioler.cxadeerfooo', 'https://lh3.googleusercontent.com/FDJeQYIV-xsZOeYcN3PXLUT1pgzT8mtBlnVuFuE4X0Y5Ud-1CPhPPTJr5XvD_rGse6A', '2018-01-03 17:00:16.515011','' , '{''category'': [''GAME_CASINO''], ''recent_changes'': '''', ''editors_choice'': False, ''developer_url'': None, ''top_developer'': False, ''installs'': [0, 0], ''interactive_elements'': [], ''reviews_text'': '''', ''required_android_version'': ''4.0 или более поздняя'', ''developer_address'': None, ''developer_email'': ''muyarlexdar@gmail.com'', ''updated'': ''21 декабря 2017 г.'', ''size'': None, ''reviews'': 0, ''content_rating'': ''12+'', ''screenshots'': [''https://lh3.googleusercontent.com/IfZRpuX--tBimUD6DMhFB5Puz18FUwXCv7Fj8MD9IVIYqDGzH4Q_MWknA9hhXJvtbkE=h900'', ''https://lh3.googleusercontent.com/29y4OfAzVowFM9-GYK3LeaOg2S8W_67n-KCor_GxT5_KAK2z2Hsx5HBfaIGYyW190co=h900'', ''https://lh3.googleusercontent.com/ZlFiwsrAA1PY3bVYdAD1fG-oUWoaqekQaDbZ7fFf7ethoVAUEGcExqT6cmMzhHHZ=h900''], ''price'': ''0'', ''description'': ''Совсем недавно нами было выпущено уникальное и очень интересное приложение, которое придется по душе самым заядлым любителям игровых клубов. Казино вулкан уже ждет своих лучших пользователей.\nС первых минут приложение захватывает красочной плавной анимацией, стильным меню и необыкновенными спецэффектами. Интерфейс выполнен лаконично, навигация по приложению предельно проста и будет понятна пользователям всех уровней.\nВулкан игровые автоматы не требовательно к параметрам Вашего гаджета, независимо от встроенных функций и разрешения экрана, приложение будет качественно и стабильно отображаться.\nГрафика очень реалистична и поможет Вам поч