ьно в этой игре отдыхаешь... '', ''date'': ''4 января 2018 г.'', ''author'': '' Лизавета Игоревна ''}, 5: {''text'': '' Для любителей в слоты - самое то, очень затягивает, у этого приложения большое будущее '', ''date'': ''3 января 2018 г.'', ''author'': '' Roma Orlov ''}, 6: {''text'': '' Отличное приложение автоматы вулкан хороший метод заработать качай играй и выигрывай '', ''date'': ''4 января 2018 г.'', ''author'': '' Артем Карманов ''}, 7: {''text'': '' Отличное приложение игровые автоматы вулкан отличное приложение и хорошая прибыль '', ''date'': ''4 января 2018 г.'', ''author'': '' Алёна Ермакова ''}}, ''reviews'': 10, ''editors_choice'': False, ''developer_id'': None, ''free'': True, ''interactive_elements'': [], ''category'': [''GAME_CASINO''], ''developer_address'': ''Russia'', ''recent_changes'': '''', ''description'': ''Заходи на огонек - в слоты поиграть! Одно из лучших мобильных приложений, над которым трудились профессиональные игроки, теперь может быть и на твоем мобильном.\n► Огромные выплаты, слоты с низкой дисперсией, которые часто и много - все ради того, чтобы каждый твой спин был выигрышным!\n► Множество видов игровых аппаратов: делюкс, классические, новинки!\n► Тематики: только best of the best!\n► Честная игра гарантирована!\n► Виртуальная валюта вместо реальных денег!\n► Самые разнообразные спец символы, прогрессивный джекпот!\n► Бонусы без ограничений!\n► Атмосфера реального казино! Пока вы отдыхаете - слоты крутят и платят!'', ''score'': 5.0, ''current_version'': ''1.1.2'', ''developer_email'': ''gena.gaytud@gmail.com'', ''updated'': ''29 декабря 2017 г.'', ''content_rating'': ''12+''}');
