INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.thorgames.gocasi', 'ANDROID', '2018-01-08 03:01:39.476304', 'Слоты фараона вулкан казино', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.thorgames.gocasi', 'https://lh3.googleusercontent.com/_dygoIcFL12FEB5EPXw51wPdK0t6vuepV6eLZ3TmHLF4NNmrYglObGeKGsxqNOUpZw', '2018-01-08 15:30:42.158223','' , '{''developer'': ''ThorGames'', ''price'': ''0'', ''required_android_version'': ''4.1 или более поздняя'', ''app_id'': ''com.thorgames.gocasi'', ''description'': ''Приготовьтесь исследовать самые загадочные места мира на очень увлекательной слот-машине, отправляйтесь прямо в сердце Египта. Играть в эти слоты – просто сказка – легко понять что к чему, массивные выигрыши, уникальные бонусные игры. Присоединяйтесь к Фараону и Клеопатре в захватывающем приключении. Играй как настоящий победитель, побеждай как настоящий правитель!\nОткройте секрет могущественного фараона и найдите сокрытый путь к слот-машине великой пирамиды, где сокровища Нила ждут вас! Увесистые джек-поты всего в одном щелчке мыши для тех, кто хочет заглянуть в Книгу Ра по дороге в долину магии.\nСКАЧАЙТЕ СЕЙЧАС! ВАМ ПОНРАВЯТСЯ СЛОТЫ – УДАЧА ФАРАОНА!\nВ этой азартной игре есть уйма вариантов выигрышей: миллионы на джек-поте, сотни бесплатных «спинов», бесконечное количество бесплатных монет. Не важно, как много похожих игр вы уже опробовали, эта слот-машина сведёт вас с ума. Восхитительная графика, прекрасная анимация, фантастические бонусы и звуковое сопровождение гарантирует игровой опыт класса люкс.\nОсобенности этих бесплатных слотов:\nВажно:\nЭто приложение существует лишь для развлекательных целей. Ощутите себя игроком в казино и играйте соответственно.\nПроцент выигрышей, бонусы и остальные особенности нашей игры для развлечения отличаются/лучше/больше чем на настоящих слот-машинах в казино и онлайн-казино. Вам не следует ожидать таких же результатов