INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.dodffcompa.zimo', 'ANDROID', '2018-02-12 03:02:54.450121', 'Игровые слоты Удача онлайн', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.dodffcompa.zimo', 'https://lh3.googleusercontent.com/dhCMUdDv2IY7_RCG98FtWGrLZfCrCYpWoVw4rVYAQ7OiES8vICTdLvARVd83Y9qKUg', '2018-02-12 22:30:48.525497','' , '{''recent_changes'': '''', ''ratings'': {1: 9, 2: 9, 3: 9, 4: 9, 5: 9}, ''developer_email'': ''eleonoragerasimova275@gmail.com'', ''category'': [''GAME_CASINO''], ''developer'': ''Eleonora Gerasimova'', ''description'': ''Клуб Вулкан – один из наиболее известных брендов, который за долгие годы успел зарекомендовать себя как надежный и качественный сервис. В основе всей работы выделяется желание дать игрокам те ощущения, которые люди не испытывают каждый день ввиду серой суеты, работы и других хлопот.\nВ чем преимущество игровых автоматов Вулкан?\nСреди огромного масштаба современных сервисов сложно найти клуб, который будет отличаться честностью и индивидуальной работой с каждым игроком. Кроме превосходного сервиса, казино Вулкан – это еще и мощные игровые автоматы, аналогов которым не существует и по сей день. Вот лишь несколько преимуществ сервиса, которые выделяют его на фоне конкурентов:\n• оригинальные игры и функционал;\n• простой, интуитивно понятный и комфортный интерфейс всех автоматов;\n• стандартные правила без уловок, скрытых функций и возможностей;\n• гарантия стабильной работы игры, без зависаний и ошибок;\n• настоящие эмоции, сопоставимые с победами олимпийских чемпионов.\nЕсли Вы еще не участник клуба Вулкан, хватит терять свое драгоценное время в поиске качественных игровых автоматов. Вы уже их нашли. Реальные развлечения и настроение ждет Вас в нашем казино.'', ''iap_range'': None, ''developer_address'': None, ''developer_url'': None, ''reviews_text'': {0: {''date'': '''', ''text'': '' Вулкан отличное приложение для любителей испытать свою удачу .Это удобный сервис со слотами онлайн у тебя в телефоне , рекомендую ! '', ''author'': '' Dissector 700 ''}, 1: {''date'': '''', ''text'': '' Казино вулкан это самое лучшее приложение которое только может быть для настроения и поднятия денег РЕКОМЕНДУЮ ребята не пожалеете '', ''author'': '' Роман Викторович ''}, 2: {''date'': '''', ''text'': '' Вулкан довольно интересное приложение. Давно использую, меня устраивает '', ''author'': '' ''}, 3: {''date'': '''', ''text'': '' Вулкан казино. Можно просто отдохнуть, а можно выиграть реальную денежку ! '', ''author'': '' Андрей Халюков ''}, 4: {''date'': '''', ''text'': '' Отличное казино вулкан. Делаем ставочки и выигрываем денежки. Большие выигрыши и много бонусов. Рекомендую '', ''author'': '' евгений буторин ''}, 5: {''date'': '''', ''text'': '' Игровые слоты очень отличное приложение, советую это казино! '', ''author'': '' Данил Нистратов ''}, 6: {''date'': ''11 февраля 2018 г.'', ''text'': '' Вулкан отличное приложение для любителей испытать свою удачу .Это удобный сервис со слотами онлайн у тебя в телефоне , рекомендую ! '', ''author'': '' Dissector 700 ''}, 7: {''date'': ''11 февраля 2018 г.'', ''text'': '' Казино вулкан это самое лучшее приложение которое только может быть для настроения и поднятия денег РЕКОМЕНДУЮ ребята не пожалеете '', ''author'': '' Роман Викторович ''}, 8: {''date'': ''11 февраля 2018 г.'', ''text'': '' Вулкан довольно интересное приложение. Давно использую, меня устраивает '', ''author'': '' ''}, 9: {''date'': ''11 февраля 2018 г.'', ''text'': '' Вулкан казино. Можно просто отдохнуть, а можно выиграть реальную денежку ! '', ''author'': '' Андрей Халюков ''}, 10: {''date'': ''11 февраля 2018 г.'', ''text'': '' Отличное казино вулкан. Делаем ставочки и выигрываем денежки. Большие выигрыши и много бонусов. Рекомендую '', ''author'': '' евгений буторин ''}, 11: {''date'': ''11 февраля 2018 г.'', ''text'': '' Игровые слоты очень отличное приложение, совету