INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.petro.super_slots', 'ANDROID', '2018-01-07 03:00:44.396023', 'Супер слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.petro.super_slots', 'https://lh3.googleusercontent.com/7wsj7ZOTovkVTSpS2u8aATIqg6wcf-JbgE8OermBDDTFkvIYSQEQBixBmwQagpTJefE', '2018-02-02 05:00:45.226626','' , '{''description'': ''Постоянно находишься в поисках качественной, честной и интересной игры?\nСупер Слоты\nсоответствуют всем критериям и готовы удивлять тебя привлекательными бонусами, гигантскими выигрышами и крутыми предложениями.\nПросто расслабься и набирайся полезного опыта, при этом получи возможность воплотить свои мечты в реальность. Это выгодный шанс добиться успех без особых усилий. Не упускай возможность, чтобы потом не жалеть.\nСупер слоты\n– это не только приятный досуг. Это твой счастливый случай и он обречён на удачу. Устанавливай приложение на свой мобильный и наслаждайся удобным и простым интерфейсом.\nСупер Слоты\n– это:\n💰щедрые бонусы каждый день;\n💰хорошее настроение и заряд позитива;\n💰беспроблемный вывод средств;\n💰уникальная и яркая графика;\n💰лучшая возможность добиться успеха.\nИграй в кайф в любое время, в любом месте.'', ''icon'': ''https://lh3.googleusercontent.com/7wsj7ZOTovkVTSpS2u8aATIqg6wcf-JbgE8OermBDDTFkvIYSQEQBixBmwQagpTJefE'', ''iap'': False, ''developer_address'': None, ''iap_range'': None, ''category'': [''GAME_CASINO''], ''reviews'': 9, ''content_rating'': ''12+'', ''description_html'': ''Постоянно находишься в поисках качественной, честной и интересной игры? <b>Супер Слоты</b> соответствуют всем критериям и готовы удивлять тебя привлекательными бонусами, гигантскими выигрышами и крутыми предложениями.<br/>Просто расслабься и набирайся полезного опыта, при этом получи возможность воплотить свои мечты в реальность. Это выгодный шанс добиться успех без особых усилий. Не упускай возможность, чтобы потом не жалеть.<br/><b>Супер слоты</b> – это не только приятный досуг. Это твой счастливый случай и он обречён на удачу. Устанавливай приложение на свой мобильный и наслаждайся удобным и простым интерфейсом.<br/><br/><b>Супер Слоты</b> – это:<br/>💰щедрые бонусы каждый день;<br/>💰хорошее настроение и заряд позитива;<br/>💰беспроблемный вывод средств;<br/>💰уникальная и яркая графика;<br/>💰лучшая возможность добиться успеха.<br/><br/>Играй в кайф в любое время, в любом месте.'', ''developer'': ''Пётр Напалкин'', ''screenshots'': [''https://lh3.googleusercontent.com/kzuMdPlnV2uOdjDrRW-dT-GGU82TFI4dL9hlHSiC-xDO6M_Z_F2ldSwWo_rGYJqKNNEB=h900'', ''https://lh3.googleusercontent.com/nSyAPdXym2VQWGThRT3M2gidN8u_NaA4GSiwOE4J1WMHmmMRvSeEA5IJVhnDJmXceoo=h900'', ''https://lh3.googleusercontent.com/YtNtFxJc8VT7xrd3s52dpbiopW8sgQiDSvMGqMNYOCeToVcSaQIoE4Ubs4GjdinY_8g=h900''], ''interactive_elements'': [], ''ratings'': {1: 1, 2: 1, 3: 1, 4: 1, 5: 1}, ''score'': 4.55555534362793, ''reviews_text'': {0: {''author'': '' '', ''text'': '' Поиграл немного на досуге в супер слоты, получил позитив в настроении на день. Повезло удалось оказаться в выигрыше, деньги вывел сразу что легко и удобно. Будет свободное время испытаю удачу ещё. '', ''date'': ''''}, 1: {''author'': '' '', ''text'': '' От нечего делать, в Новогодние праздники установила программу супер - слоты Вулкан на свой смартфон. Приложение понравилось своей красочной графикой и простотой управления. Я уже успела вывести свою первую выигранную сумму. '', ''date'': ''''}, 2: {''author'': '' Дмитрий Ширяев '', ''text'': '' Играю каждый день, начинал с минимальных ставок и выигрывал. Сейчас и ставки другие и выигрыши больше. Все слоты работают, деньги выводятся без проблем. Хорошее приложение для пополнения кошелька. '', ''date'': ''''}, 3: {''author'': '' Сафар Джумаев '', ''text'': '' Ребята все это лахатром я 500 руб положел нету это деньги не саветю вам играть '', ''date'': ''''}, 4: {''author'': '' MrArheon '', ''text'': '' Нормальные условия по вкладам и ставкам. Есть кэшбэк и вывод от полтинника. Пробовал с минимальным депо с самых маленьких ставок. Вывод работает. Азартное развлечение и заработок заодно. '', ''date'': ''''}, 5: {''author'': '' Наталья Андреева '', ''text'': '' Играю в приложение "Супер слоты" всего 3-ий день. За это время уже успело сложится мнение об этом приложение, мнение положительное. Работает приложение стабильно, да и слоты тут подобраны хорошие. '', ''date'': ''''}, 6: {''author'': '' '', ''text'': '' Поиграл немного на досуге в супер слоты, получил позитив в настроении на день. Повезло удалось оказаться в выигрыше, деньги вывел сразу что легко и удобно. Будет свободное время испытаю удачу ещё. '', ''date'': ''6 января 2018 г.''}, 7: {''author'': '' '', ''text'': '' От нечего делать, в Новогодние праздники установила программу супер - слоты Вулкан на свой смартфон. Приложение понравилось своей красочной графикой и простотой управления. Я уже успела вывести свою первую выигранную сумму. '', ''date'': ''5 января 2018 г.''}, 8: {''author'': '' Дмитрий Ширяев '', ''text'': '' Играю каждый день, начинал с минимальных ставок и выигрывал. Сейчас и ставки другие и выигрыши больше. Все слоты работают, деньги выводятся без проблем. Хорошее приложение для пополнения кошелька. '', ''date'': ''6 января 2018 г.''}, 9: {''author'': '' Сафар Джумаев '', ''text'': '' Ребята все это лахатром я 500 руб положел нету это деньги не саветю вам играть '', ''date'': ''4 января 2018 г.''}, 10: {''author'': '' MrArheon '', ''text'': '' Нормальные условия по вкладам и ставкам. Есть кэшбэк и вывод от полтинника. Пробовал с минимальным депо с самых маленьких ставок. Вывод работает. Азартное развлечение и заработок заодно. '', ''date'': ''5 января 2018 г.''}, 11: {''author'': '' Наталья Андреева '', ''text'': '' Играю в приложение "Супер слоты" всего 3-ий день. За это время уже успело сложится мнение об этом приложение, мнение положительное. Работает приложение стабильно, да и слоты тут подобраны хорошие. '', ''date'': ''6 января 2018 г.''}, 12: {''author'': '' '', ''text'': '' Классное приложение. Уже смог несколько раз получить неплохой выигрыш. Все работает чётко, так что я согласен чо всеми положительными отзывами. Я однозначно всем рекомендую. '', ''date'': ''6 января 2018 г.''}, 13: {''author'': '' '', ''text'': '' Зависаю в приложении суперслоты вулкан по нескольку раз в день. Радует яркая, красочная графика, удобный интерфейс, ну и, конечно, частые выигрыши и большие ежедневные бонусы. '', ''date'': ''6 января 2018 г.''}}, ''recent_changes'': '''', ''size'': None, ''thumbnails'': [''https://lh3.googleusercontent.com/kzuMdPlnV2uOdjDrRW-dT-GGU82TFI4dL9hlHSiC-xDO6M_Z_F2ldSwWo_rGYJqKNNEB=h310'', ''https://lh3.googleusercontent.com/nSyAPdXym2VQWGThRT3M2gidN8u_NaA4GSiwOE4J1WMHmmMRvSeEA5IJVhnDJmXceoo=h310'', ''https://lh3.googleusercontent.com/YtNtFxJc8VT7xrd3s52dpbiopW8sgQiDSvMGqMNYOCeToVcSaQIoE4Ubs4GjdinY_8g=h310''], ''developer_email'': ''napalkin.p@gmail.com'', ''price'': ''0'', ''top_developer'': False, ''developer_id'': None, ''free'': True, ''updated'': ''28 декабря 2017 г.'', ''app_id'': ''com.petro.super_slots'', ''url'': ''https://play.google.com/store/apps/details?id=com.petro.super_slots'', ''developer_url'': ''https://pastebin.com/K8uQkERE'', ''installs'': [100, 500], ''video'': None, ''title'': ''Супер слоты'', ''current_version'': ''4.35'', ''editors_choice'': False, ''required_android_version'': ''4.3 или более поздняя''}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('eu.phoenix.freeslot', 'ANDROID', '2018-02-11 03:03:22.716562', 'Клуб - Игровые автоматы и Слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=eu.phoenix.freeslot', 'https://lh3.googleusercontent.com/mbK94Os6fiVMnc8sw-9wyGVrX6q4_BPLpQjmgQkRzyceraiJan5PXkSlttEbob9Ea2g', '2018-02-12 17:30:40.892949','' , '{''reviews'': 18, ''iap'': False, ''current_version'': ''1.2'', ''description'': ''Вулкан Казино\nодно из самых качественных приложений в мире азарта и игровых автоматов онлайн. Играйте в\nлучшие вулкан игровые автоматы\nбез регистрации и дополнительных трат времени. Слоты вулкан теперь открывают новые горизонты перед поклонниками и любителями острых ощущений, волнующего азарта, который можно испытать разве, что только в\nказино\n.\nДля Вас подобраны захватывающие квест слоты, аутентичные игровые автоматы. Разнообразие апаратов онлайн просто поражает воображение. С приложением\nКазино Вулкан\nВы можете быть уверены в качестве игр и надежности нашего Клуба онлайн.\nВ нашем приложении собраны только\nкачественные и современные слоты онлайн\n: современная прорисованная графика, плавная анимация, уникальная музыка создаст атмосферу, которой знаменит\nВулкан 24\n. Больше не нужно скачивать массу приложений в поисках достойного уровня игры и надежного казино - мы сделали это за Вас. Просто отдайтесь игре, а Удача поможет Вам.\nВ приложении работает круглосуточная техническая поддержка.  А играть в\nВулкан\nможно практически на любой версии Android. Грамотные специалисты помогут и ответят на все интересующие Вас вопросы в режиме онлайн.\nВулкан Казино - новый уровень азарта!'', ''thumbnails'': [''https://lh3.googleusercontent.com/HMdzbzWxnk3ndoGzvq6f45m4J_fwMjHXiGbTdad-EKGVjZUroLIiRZ_ivytOnXK-X6g=h310'', ''https://lh3.googleusercontent.com/4r93TI5PVYRRTE7v23zNMvFr3ZEKlGxc6PpKVBXNTyn-6btgoTdI79MA5ND4SqSf6rc=h310'', ''https:/