INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('1188664775', 'IOS', '2017-10-31 23:02:25.151552', 'Джинн Слоты - Игровые автоматы вулкан удачи!', 'UNAVAILABLE', 'https://itunes.apple.com/ru/app/id1188664775', 'http://is4.mzstatic.com/image/thumb/Purple128/v4/94/55/b5/9455b553-6c8e-8e24-2dcd-3553c663fe27/mzl.uiydmemr.png/175x175bb-85.png', '2018-01-19 14:06:13.071318','' , '{''link'': {''attributes'': {''rel'': ''alternate'', ''href'': ''https://itunes.apple.com/ru/app/%D0%B4%D0%B6%D0%B8%D0%BD%D0%BD-%D1%81%D0%BB%D0%BE%D1%82%D1%8B-%D0%B8%D0%B3%D1%80%D0%BE%D0%B2%D1%8B%D0%B5-%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D1%8B-%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD-%D1%83%D0%B4%D0%B0%D1%87%D0%B8/id1188664775?mt=8&uo=2'', ''type'': ''text/html''}}, ''rights'': {''label'': ''© 2017 Slot Star Pro''}, ''im:name'': {''label'': ''Джинн Слоты - Игровые автоматы вулкан удачи!''}, ''im:price'': {''attributes'': {''currency'': ''RUB'', ''amount'': ''0.00000''}, ''label'': ''Загрузить''}, ''category'': {''attributes'': {''scheme'': ''https://itunes.apple.com/ru/genre/ios-%D0%B8%D0%B3%D1%80%D1%8B/id6014?mt=8&uo=2'', ''im:id'': ''6014'', ''label'': ''Игры'', ''term'': ''Games''}}, ''im:artist'': {''attributes'': {''href'': ''https://itunes.apple.com/ru/developer/sliwinski-slawomir/id1188664774?mt=8&uo=2''}, ''label'': ''Sliwinski Slawomir''}, ''im:image'': [{''attributes'': {''height'': ''53''}, ''label'': ''http://is1.mzstatic.com/image/thumb/Purple128/v4/94/55/b5/9455b553-6c8e-8e24-2dcd-3553c663fe27/mzl.uiydmemr.png/53x53bb-85.png''}, {''attributes'': {''height'': ''75''}, ''label'': ''http://is3.mzstatic.com/image/thumb/Purple128/v4/94/55/b5/9455b553-6c8e-8e24-2dcd-3553c663fe27/mzl.uiydmemr.png/75x75bb-85.png''}, {''attributes'': {''height'': ''100''}, ''label'': ''http://is4.mzstatic.com/image/thumb/Purple128/v4/94/55/b5/9455b553-6c8e-8e24-2dcd-3553c663fe27/mzl.uiydmemr.png/100x100bb-85.png''}], ''title'': {''label'': ''Джинн Слоты - Игровые автоматы вулкан удачи! - Sliwinski Slawomir''}, ''summary'': {''label'': ''Скачай игровые автоматы 2017 и играй без интернета\nНикаких докачек, все видео слоты доступны сразу!\nКуча бесплатных спинов и море бонусных игр! \n\nМы сделали игровой автомат в классическом и столь популярной тематике - ферма! Все привлекательные животные анимированы - попробуй поймать комбинацию и ты увидишь сам! На этом игровом автомате легко заработать огромные выигрыши по тому, что мы сделали необычный WILD. Если на поле выпадет трактор, то он проедет по всем символам на линии и превратит овощи в WILD! Тут очень высок шанс получить 5 в ряд! А если тебе действительно улыбнется удача и попадешь в бонусную игру - то чучела выпрыгнут из символов и сделают из поля - грядку, где у тебя не останется возможности не сорвать большой куш! Ну и конечно же популярная система ретригера бесплатных спинов - в режиме фри спин. Если тебе выпадут хотя бы два амбара - ты получишь еще шанс увеличить свой выигрыш.\n \nПогрузиться в атмосферу подводного мира позволит Морской слот. Он имеет другую особенность, в нем ты и попробуешь собрать максимальную последовательность волн. Каждая волна сдвигает символы вправо давая Бесплатный спин - что если в один из этих ходов выпадет бонус? Тогда тебя ждет бонусная игра - найди три одинаковых значения, это значение и будет твоим выигрышем! Поверь - выигрыш будет действительно большим!\n \nНу а если ты достаточно храбр чтобы поймать настоящего криминального авторитета из прошлого - тогда для тебя Wild wild slot! В режиме бесплатных спинов ты попадешь в настоящую перестрелку! Две противоборствующие стороны начнут палить друг друга, призывая на помощь своих товарищей! Бандит прячется в таверне и чтоб попасть туда - тебе придется постараться. Выбери героя который тебе больше всего приглянулся и сразись с преступником! Но дуэль будет не простой - вам придется сыграть в кости и выяснить на чьей стороне удача. Победив ты получишь внушительную награду.\n \nВыясни кто сильнее из них и чья магия мощнее в секретном игровом аппарат для тех кто хочет получить ВИП клуб статус! Отправься в мир ледяных монстров и воюющих кланов hold the slot, но если тебе на пути попадется ледяной монстр - берегись, он сразу заморозит дорогой символ и оставит его на поле до конца бесплатных спинов. На помощь тебе может прийти вулкан, взорвав который - монстры будут побеждены! Возможно, ледяной монстр поможет тебе собрать все поле дорогих символов и тогда слот отдаст все свои деньги!\n \nКонечно же мы не забыли и про классические карточные игры 777, что если карты помогут тебе сорвать куш? Исполненные в необычном стиле символы позволят сосредоточится на поимке удачи за хвост. Бонусная игра в карточном слоте подвергнет твое везение настоящей проверке, выбери нужную кнопку что бы пройти на максимальный уровень наград и тогда на тебя обрушиться куча монет!\n \nНу и конечно же слоты с возможностью выиграть джекпот! Помни, так просто ты его не получишь, он откроется только самым удачливым игрокам, которые смогли накопить достаточно денег, что бы запустить режим джекпот. Тебе представится возможность сыграть аж в целых три колеса фортуны! Попробуй получи ключик открывающий доступ к следующему колесу и получи свой огромный выигрыш!\n \nНе забывай заходить в игру каждые два часа и забирать бонус, который растет с получением нового уровня! А так же ежедневный огромный выигрыш, который поможет играть даже если все средства были проиграны. В игре добавлена возможность получать игровые деньги через просмотр рекламы - пользуйся этим на здоровье!''}, ''im:contentType'': {''attributes'': {''label'': ''Приложение'', ''term'': ''Application''}}, ''id'': {''attributes'': {''im:bundleId'': ''com.slotstarpro.excitedslots'', ''im:id'': ''1188664775''}, ''label'': ''https://itunes.apple.com/ru/app/%D0%B4%D0%B6%D0%B8%D0%BD%D0%BD-%D1%81%D0%BB%D0%BE%D1%82%D1%8B-%D0%B8%D0%B3%D1%80%D0%BE%D0%B2%D1%8B%D0%B5-%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%8