JzWBtTqwxHdrw=h900''], ''url'': ''https://play.google.com/store/apps/details?id=com.satiokigmb.stone'', ''developer_url'': None, ''reviews_text'': {0: {''author'': '' SV Makagon '', ''date'': '''', ''text'': '' Друг кинул ссыль на приложение вулкан. Слотами балуюсь давно, но надолго не хватало, а тут все в одном месте, все удобно. Супер! Часами можно не вылезать! ''}, 1: {''author'': '' Jolly Fly '', ''date'': '''', ''text'': '' Приложение восхищает. Покорен был сразу после того, как скачал. Девушка сразу не одобряла, а сейчас и сама рада поиграть в Вулкан! ''}, 2: {''author'': '' TheMoran TM '', ''date'': '''', ''text'': '' Реальный Вулкан, такой кэш давно не поднимал! скачивайте и качайтесь... У меня все, пойду выводить бабки ''}, 3: {''author'': '' Alexander Skudrev '', ''date'': '''', ''text'': '' Стильное оформление, огромный выбор слотов в казино Вулкан, хорошие выигрыши и бонусы... Словом, не вижу необходимости искать другие приложения! ''}, 4: {''author'': '' Artem Aleksandrovich '', ''date'': '''', ''text'': '' Наконец то я нашёл тот самый Вулкан. Играть в игровые автоматы одно удовольствие. Рекомендую! ''}, 5: {''author'': '' '', ''date'': '''', ''text'': '' Крутое приложение Вулкан. Втянулась с первых дней. Интерфейс впечатлил — юзаю с удовольствием и останавливаться не хочу! ''}, 6: {''author'': '' SV Makagon '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Друг кинул ссыль на приложение вулкан. Слотами балуюсь давно, но надолго не хватало, а тут все в одном месте, все удобно. Супер! Часами можно не вылезать! ''}, 7: {''author'': '' Jolly Fly '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Приложение восхищает. Покорен был сразу после того, как скачал. Девушка сразу не одобряла, а сейчас и сама рада поиграть в Вулкан! ''}, 8: {''author'': '' TheMoran TM '', ''date'': ''1 февраля 2018 г.'', ''text'': '' Реальный Вулкан, такой кэш давно не поднимал! скачивайте и качайтесь... У меня все, пойду выводить бабки ''}, 9: {''author'': '' Alexander Skudrev '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Стильное оформление, огромный выбор слотов в казино Вулкан, хорошие выигрыши и бонусы... Словом, не вижу необходимости искать другие приложения! ''}, 10: {''author'': '' Artem Aleksandrovich '', ''date'': ''31 января 2018 г.'', ''text'': '' Наконец то я нашёл тот самый Вулкан. Играть в игровые автоматы одно удовольствие. Рекомендую! ''}, 11: {''author'': '' '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Крутое приложение Вулкан. Втянулась с первых дней. Интерфейс впечатлил — юзаю с удовольствием и останавливаться не хочу! ''}, 12: {''author'': '' Max Smidt '', ''date'': ''31 января 2018 г.'', ''text'': '' Очень удобно, Вулкан, всегда в кармане под рукой большие деньги. Хороший интерфейс, всё понятно и круто, нереальный вулкан!!! ''}, 13: {''author'': '' Игорь Новиков '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Так удобно в кармане носить целое казино. Вулкан качал раза четыре. В этом приложении приглянулся интерфейс и интуитивное расположение кнопок. ''}, 14: {''author'': '' Руслан Макеев '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Игрушка определенно прикольная. Вулкан слоты затягивают, а качество исполнения приложения только добавит охотников поиграть. Мне нравится. ''}, 15: {''author'': '' Андрій Тимчишак '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Годное приложение! Вулкан слоты зачетные. Скачал пару месяцев назад. Полет нормальный. Рекомендую! ''}, 16: {''author'': '' '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Для меня настоящим открытием стало появление приложения вулкан слоты. Удобное во всех отношениях. ''}, 17: {''author'': '' Антон Кузьмичев '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Приложение Вулкан затянуло. Понравилось и наличие большого выбора игр, и бонусы, и регулярные турниры. Все отлично! Буду рекомендовать! ''}, 18: {''author'': '' Евгения Смирнова '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Как-то в поезде скачала это приложение, и теперь с него не слажу второй месяц. Мало того, чсто развлекаешься, так еще и денег заработать можно в Вулкан! ''}, 19: {''author'': '' '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Перебрал с десяток приложений,и пока лидером во всех отношениях стало именно это приложение Вулкан. Спасибо тем,кто его придумал. ''}, 20: {''author'': '' Алена Магула '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Вулкан слоты нереальные. Играла много, но после этого приложения, на другие переходить нет никакого желания) ''}, 21: {''author'': '' Юлик Кузя '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Задумка Вулкан отличная, слотов много, все практично и просто. Люблю приложения с большим количеством классики. Тут нашел все, что мне нужно! Спасибо. ''}, 22: {''author'': '' '', ''date'': ''1 февраля 2018 г.'', ''text'': '' Очень удобно, Вулкан, всегда в кармане под рукой большие деньги. Хороший интерфейс, всё понятно и круто, нереальной вулкан!!! ''}, 23: {''author'': '' Сергій Карпенко '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Обожаю Казино Вулкан за классические слоты такого качества! Качайте - не пожалеете! ''}, 24: {''author'': '' '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Отличное юзабельное приложение с грамотным интерфейсом. С казино вулкан давно играю - знаю, что говорю. ''}, 25: {''author'': '' Иван Васильев '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Зачетное приложение вулкан без тараканов, бреда и бесконечных проигрышей. Пока все нравится! ''}}, ''description'': ''Отдыхать можно по-разному, например, можно одновременно развлечься и получить дополнительные финансовые вливания. Для этого стоит посетить онлайн-казино Вулкан, которое работает для вас 24 часа в сутки.\nСкачивайте специальное приложение на смартфон, компьютер или планшет, становитесь членом клуба Удача и ваш выигрыш не заставит себя ждать. Особое внимание обратите на игровые автоматы Вулкан. Выбрав этот вид игры, вы даже не почувствуете разницу с реальным казино, так как виртуальные устройства выглядят не хуже, чем настоящие. Высококачественная графика, отличное звуковое сопровождение, удобное управление – эти игровые аппараты просто притягивают к себе, дарят массу острых ощущений и радуют приличными выигрышами.\nЕще одним преимуществом клуба Вулкан является его надежное программное обеспечение, которое не зависает, не «тормозит», а это значит, что настроение игрока никогда не будет испорчено внезапным сбоем. Большой выбор онлайн-слотов поможет вам выбрать самые интересные и посвятить им свое свободное время.\nЯркое, интересное времяпрепровождение, живые эмоции, азарт и реальные деньги – все это казино Вулкан!'', ''installs'': [100, 500], ''iap'': False, ''developer_address'': None}');
