тся много усилий – возьмите планшет или телефон, скачайте наше приложение в бесплатном доступе и запустите. Что дальше? А дальше Вас ожидает яркая анимация, веселые спецэффекты, плавная навигация и захватывающая незабываемая игра.'', ''releaseDate'': ''2017-10-21T03:22:37Z''}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('izve.slo.ts', 'ANDROID', '2018-02-03 03:03:15.680573', 'Известные слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=izve.slo.ts', 'https://lh3.googleusercontent.com/yTZfyMPbBmU0z3ZOIbdw6spfWxCHNy3AFWQTzjeKX6h2XLJAtggHzKGLZqo1CbdA8g', '2018-02-20 19:00:39.975783','' , '{''icon'': ''https://lh3.googleusercontent.com/yTZfyMPbBmU0z3ZOIbdw6spfWxCHNy3AFWQTzjeKX6h2XLJAtggHzKGLZqo1CbdA8g'', ''content_rating'': ''12+'', ''score'': 4.199999809265137, ''recent_changes'': '''', ''reviews'': 5, ''developer_email'': ''nosychevayana1@gmail.com'', ''editors_choice'': False, ''size'': None, ''required_android_version'': ''4.1 или более поздняя'', ''ratings'': {1: 1, 2: 1, 3: 1, 4: 1, 5: 1}, ''top_developer'': False, ''description_html'': ''Вашему вниманию предоставляются новые онлайн игровые автоматы Вулкан! Территория азарта и огромных выигрышей! Масса бонусов и призов от Вулкан 24 онлайн ждут вас. <br/>Ищете настоящий клуб слотов? Погрузитесь в игровые автоматы и слоты, которые перенесут вас в мир настоящего казино. Ваша жизнь обогатится настоящими эмоциями, а так же невероятно крупными выигрышами. <br/><br/>★ Преимущества приложения <br/>▸ Современная графика <br/>Для полного погружения в мир клуба игровых автоматов Вулкан отлично прорисована графика. Теперь вы можете окунуться в мир азарта прямо с вашего смартфона или планшета.<br/>▸ Удобный геймплей <br/>Для удобства игры сделан интуитивно понятный геймплей. Играйте удобно!<br/><br/>★ Особенности приложения <br/>▸ Прогрессивный Джекпот <br/>Крутите больше слотов и выигрывайте еще больше!<br/>▸ Масса слотов онлайн <br/>Все любимые игровые апараты собраны в одном приложении. <br/>▸ Новые слоты <br/>Постоянное добавление новых игровых автоматов казино не заставит вас скучать! Играйте в своё удовольствие!'', ''video'': None, ''title'': ''Известные слоты'', ''thumbnails'': [''https://lh3.googleusercontent.com/-TV7dai8vLzr16aKSN4si9qDQygU0TczT7xVuZkp0Jn-uSt3O95oRtejW8P9IMEM7j4=h310'', ''https://lh3.googleusercontent.com/wUoN7VbO7LYAa22eDC-qRivTK85KWL2BhYQu8IF8w2jaPpNvHxPAQ6t1fuXDbX_dhg=h310'', ''https://lh3.googleusercontent.com/rFqgWApMn8UqOsqeB3MIfLaU5LoJl31UedTsjH1LmjTC39QJ3jEzkTIW8jl-2-VwVZo=h310''], ''current_version'': ''1.2.1'', ''developer'': ''Яна Носичева'', ''price'': ''0'', ''updated'': ''26 января 2018 г.'', ''app_id'': ''izve.slo.ts'', ''iap_range'': None, ''interactive_elements'': [], ''free'': True, ''category'': [''GAME_CASINO''], ''developer_id'': None, ''screenshots'': [''https://lh3.googleusercontent.com/-TV7dai8vLzr16aKSN4si9qDQygU0TczT7xVuZkp0Jn-uSt3O95oRtejW8P9IMEM7j4=h900'', ''https://lh3.googleusercontent.com/wUoN7VbO7LYAa22eDC-qRivTK85KWL2BhYQu8IF8w2jaPpNvHxPAQ6t1fuXDbX_dhg=h900'', ''https://lh3.googleusercontent.com/rFqgWApMn8UqOsqeB3MIfLaU5LoJl31UedTsjH1LmjTC39QJ3jEzkTIW8jl-2-VwVZo=h900''], ''url'': ''https://play.google.com/store/apps/details?id=izve.slo.ts'', ''developer_url'': ''http://ikqwbcl.ru/policypr/'', ''reviews_text'': {0: {''author'': '' Михаил Михайлов '', ''date'': '''', ''text'': '' Казино вулкан клуб азарта для меня это настоящее открытие! ''}, 1: {''author'': '' Андрей Эвертон '', ''date'': '''', ''text'': '' Казино вулкан суперское пособие для того чтобы стать богатым. Я в шоке. Казино даёт большие выйгрыши. Всем друзьям посоветовал и теперь не один богатею. Играйте и удача придёт. Всем хорошего настроения. ''}, 2: {''author'': '' '', ''date'': '''', ''text'': '' Есть и лучшие ''}, 3: {''author'': '' '', ''date'': '''', ''text'': '' Казино вулкан даёт шанс на выйгрыш, есть бонусы!!! Отличное приложение ''}, 4: {''author'': '' Алексей Мамаев '', ''date'': '''', ''text'': '' Казино вулкан отличное приложение с хорошей графикой и управлением ''}, 5: {''author'': '' Михаил Михайлов '', ''date'': ''29 января 2018 г.'', ''text'': '' Казино вулкан клуб азарта для меня это настоящее открытие! ''}, 6: {''author'': '' Андрей Эвертон '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Казино вулкан суперское пособие для того чтобы стать богатым. Я в шоке. Казино даёт большие выйгрыши. Всем друзьям посоветовал и теперь не один богатею. Играйте и удача придёт. Всем хорошего настроения. ''}, 7: {''author'': '' '', ''date'': ''28 января 2018 г.'', ''text'': '' Есть и лучшие ''}, 8: {''author'': '' '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Казино вулкан даёт шанс на выйгрыш, есть бонусы!!! Отличное приложение ''}, 9: {''author'': '' Алексей Мамаев '', ''date'': ''2 февраля 2018 г.'', ''text'': '' Казино вулкан отличное приложение с хорошей графикой и управлением ''}}, ''description'': ''Вашему вниманию предоставляются новые онлайн игровые автоматы Вулкан! Территория азарта и огромных выигрышей! Масса бонусов и призов от Вулкан 24 онлайн ждут вас.\nИщете настоящий клуб слотов? Погрузитесь в игровые автоматы и слоты, которые перенесут вас в мир настоящего казино. Ваша жизнь обогатится настоящими эмоциями, а так же невероятно крупными выигрышами.\n★ Преимущества приложения\n▸ Современная графика\nДля полного погружения в мир клуба игровых автоматов Вулкан отлично прорисована графика. Теперь вы можете окунуться в мир азарта прямо с вашего смартфона или планшета.\n▸ Удобный геймплей\nДля удобства игры сделан интуитивно понятный геймплей. Играйте удобно!\n★ Особенности приложения\n▸ Прогрессивный Джекпот\nКрутите больше слотов и выигрывайте еще больше!\n▸ Масса слотов онлайн\nВсе любимые игровые апараты собраны в одном приложении.\n▸ Новые слоты\nПостоянное добавление новых игровых автоматов казино не заставит вас скучать! Играйте в своё удовольствие!'', ''installs'': [1000, 5000], ''iap'': False, ''developer_address'': None}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('1281653029', 'IOS', '2018-02-22 03:01:34.880411', 'Слоты - игровые автоматы удачи', 'AVAILABLE', 'https://itunes.apple.com/ru/app/id1281653029', 'http://is2.mzstatic.com/image/thumb/Purple118/v4/97/20/51/972051a2-6ab7-e8fd-c7c7-c51b9612bd41/pr_source.png/175x175bb-85.png', null,'' , '{''title'': {''label'': ''Слоты - игровые автоматы удачи - Andrew Peterson''}, ''im:price'': {''attributes'': {''currency'': ''RUB'', ''amount'': ''0.00000''}, ''label'': ''Загрузить''}, ''id'': {''attributes'': {''im:bundleId'': ''zodadidi'', ''im:id'': ''1281653029''}, ''label'': ''https://itunes.apple.com/ru/app/%D1%81%D0%BB%D0%BE%D1%82%D1%8B-%D0%B8%D0%B3%D1%80%D0%BE%D0%B2%D1%8B%D0%B5-%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D1%8B-%D1%83%D0%B4%D0%B0%D1%87%D0%B8/id1281653029?mt=8&uo=2''}, ''im:artist'': {''attributes'': {''href'': ''https://itunes.apple.com/ru/developer/andrew-peterson/id1281653028?mt=8&uo=2''}, ''label'': ''Andrew Peterson''}, ''im:image'': [{''attributes'': {''height'': ''53''}, ''label'': ''http://is4.mzstatic.com/image/thumb/Purple118/v4/97/20/51/972051a2-6ab7-e8fd-c7c7-c51b9612bd41/pr_source.png/53x53bb-85.png''}, {''attributes'': {''height'': ''75''}, ''label'': ''http://is1.mzstatic.com/image/thumb/Purple118/v4/97/20/51/972051a2-6ab7-e8fd-c7c7-c51b9612bd41/pr_source.png/75x75bb-85.png''}, {''attributes'': {''height'': ''100''}, ''label'': ''http://is2.mzstatic.com/image/thumb/Purple118/v4/97/20/51/972051a2-6ab7-e8fd-c7c7-c51b9612bd41/pr_source.png/100x100bb-85.png''}], ''link'': {''attributes'': {''rel'': ''alternate'', ''href'': ''https://itunes.apple.com/ru/app/%D1%81%D0%BB%D0%BE%D1%82%D1%8B-%D0%B8%D0%B3%D1%80%D0%BE%D0%B2%D1%8B%D0%B5-%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D1%8B-%D1%83%D0%B4%D0%B0%D1%87%D0%B8/id1281653029?mt=8&uo=2'', ''type'': ''text/html''}}, ''im:name'': {''label'': ''Слоты - игровые автоматы удачи''}, ''im:releaseDate'': {''attributes'': {''label'': ''13.09.2017''}, ''label'': ''2017-09-13T17:38:27-07:00''}, ''rights'': {''label'': ''© Andrew Peterson''}, ''im:contentType'': {''attributes'': {''term'': ''Application'', ''label'': ''Приложение''}}, ''category'': {''attributes'': {''term'': ''Games'', ''label'': ''Игры'', ''im:id'': ''6014'', ''scheme'': ''https://itunes.apple.com/ru/genre/ios-%D0%B8%D0%B3%D1%80%D1%8B/id6014?mt=8&uo=2''}}, ''summary'': {''label'': ''Встречайте! Наконец-то настоящие игровые автоматы - теперь и в твоем мобильном.\n\nЕсли вы раньше не играли в слоты, то стоит только попробовать, вы сразу проникнетесь атмосферой азарта и выигрышей. Теперь казино всегда будет доступно для вас, где бы вы не находились. Если вы любите азарт, Слоты - это для тебя.\n\nДаже если у тебя есть всего 5 минут свободного времени, ты успеешь сделать ставки и сорвать джекпот. Проверь, сопутствует ли тебе удача. Рискни и сделай самую большую ставку в слоте.\n\nРазбуди свой вулкан удачи!''}}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.podlenguathed.slas', 'ANDROID', '2018-02-22 03:00:45.531443', 'Лучшие слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.podlenguathed.slas', 'https://lh3.googleusercontent.com/dazkaeT7Bwnq-NER0IMjBVZh7ArzV6Sdls28PFzcqI0QJgbXk4_NGAwABmd0DpPSvXhe', '2018-02-23 23:30:36.989224','' , '{''title'': ''Лучшие слоты'', ''size'': None, ''description_html'': ''Уже долгое время, у самых заядлых игроков в слоты и игровые автоматы вулкан, самым честным, качественным и лучшим считается казино вулкан!<br/>На данный момент мы собрали здесь лучшие игровые аппараты и игровые слоты вулкан, мы руководствовались вашими оценками, вашим мнением,<br/>а так же теми игровыми атоматами которые дают больше всего денег и джекпотов, на вулкан 24 был создан с любовью и людьми знающими толк в онлайн казино<br/>и игровых апаратах!<br/><br/>Все самые топовые игровые автоматы вулкан у вас в кармане!<br/>Самые быстрые и честные выплаты!<br/>Поддержка, которая на связи 24 часа в сутки!<br/>Огромные бонусы на старте игры!<br/><br/>Играйте больше, чтобы иметь возможность оценить свой потенциал. Только после этого стоит покорять делюкс слоты, которые могут предложить большие выигрыши.<br/>Хотите узнать насколько госпожа Фортуна вас любит? Крутите барабан и наши игровые автоматы поведают вам этот секрет. Каждый, кто желает фундаментально подойти к данному вопросу, должен записывать результаты. Это позволит понять, когда вам улыбается удача, а когда стоит существенно сократить ставки на слоты. Когда речь идет о рулетке, стоит воспользоваться определенными стратегиями. Не доверяйте своей удаче на 100%.<br/><br/>Вас порадуют красочная графика, веселое музыкальное оформление, плавная анимация и невероятно простое управление. <br/>Никаких сбоев и зависаний – только быстрая и качественная работа.<br/>Вулкан автоматы – это долгожданная новинка, которая бесспорно порадует все любителей игровых слотов, не пропустите свой шанс увидеть ее собственными глазами!'', ''video'': None, ''iap_range'': None, ''interactive_elements'': [], ''installs'': [10000, 50000], ''thumbnails'': [''https://lh3.googleusercontent.com/9pi3VuIbaX3U4DJRxYh-8PSunkrYo8COYAglJ3qYzJvJtBYEBcEtlKYEYtwnO9_06Kw=h310'', ''https://lh3.googleusercontent.com/ifYZzfdn90qaNCnePwtpdEptrkxJeS8XXtCi63b-uF5pctZWG3GTIIRm6IBfqol2s5Q=h310'', ''https://lh3.googleusercontent.com/OgJmPa--l3jslT5MdJGYyRp0M1WTblTT2l6csCBzQzPJXx7FK1nvNWdjkeVxB5jLi_8=h310'', ''https://lh3.googleusercontent.com/33sHm-eC-ra7whzoBRw3ypXfeiSFDwKWC5N9M7hgoR60AndEdTLvqGrAZ-y8hBaFaw=h310'', ''https://lh3.googleusercontent.com/9172Nl8xG7L4vDmFkVzJSLV3HLUTOp9HroPW47IHTv7N5xst3Iv9N9vG2t0DoAOmMm0-=h310'', ''https://lh3.googleusercontent.com/8pMf-SvJxODI7jtyauOTE8AH5lQhV4IBwgXEcyIFnHPAD0HKra0eh6lVog7PTIjYDQ=h310'', ''https://lh3.googleusercontent.com/RhaJcPuKa8AiMNXpYPThseOgcLTmYPdsOrMBXpmPtlQt-c9bOV4c3itW1ijnxdMkyXZH=h310'', ''https://lh3.googleusercontent.com/tbz0r4ywQKOfsOwR2vD5tRyysfa0g_uWSCCVOB323G5Zn2WUxZmge8QQKXPXdrO2aeY=h310'', ''https://lh3.googleusercontent.com/QAi0W9IKmvbSZpC8utsfS5MtWAeC_YHIFh6EdKE-T5TMv3oizapHwKCU0SRMXPA8ZB9H=h310'', ''https://lh3.googleusercontent.com/InXA7O67hxL6LTqr-_wF_1BVgkjwuwOCw6pa9bA0-hm2fFbBC92euHT6NXLaDiDcRA=h310''], ''iap'': False, ''price'': ''0'', ''updated'': ''13 февраля 2018 г.'', ''icon'': ''https://lh3.googleusercontent.com/dazkaeT7Bwnq-NER0IMjBVZh7ArzV6Sdls28PFzcqI0QJgbXk4_NGAwABmd0DpPSvXhe'', ''description'': ''Уже долгое время, у самых заядлых игроков в слоты и игровые автоматы вулкан, самым честным, качественным и лучшим считается казино вулкан!\nНа данный момент мы собрали здесь лучшие игровые аппараты и игровые слоты вулкан, мы руководствовались вашими оценками, вашим мнением,\nа так же теми игровыми атоматами которые дают больше всего денег и джекпотов, на вулкан 24 был создан с любовью и людьми знающими толк в онлайн казино\nи игровых апаратах!