INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('com.gbacom.gameclubdeluxe', 'ANDROID', '2018-02-22 03:00:35.509162', 'Club Deluxe', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=com.gbacom.gameclubdeluxe', 'https://lh3.googleusercontent.com/eBG0ac6S6Ev593dKTt3vkEj4pGkQw1TRPFor2gV7lqrgd4zt6vLYvhRAN-dCZWSGyg', '2018-02-24 03:30:37.300667','' , '{''title'': ''Club Deluxe'', ''size'': None, ''description_html'': ''Ищите лучшие слоты-автоматы ? Вы их уже нашли, устанавливайте приложение и присоединяйтесь к игре в самые популярные БЕСПЛАТНЫЕ игровые слоты <b>Club Deluxe</b> ! Играйте и развлекайтесь единственными в своем роде слотами в стиле люкс, одно удовольствие без реальных затрат!\xa0<br/>Большие бонусы игровых автоматов! Делать ставки онлайн без настоящего денежного риска так просто, ведь у вас есть целый вагон бесплатных монеток!<br/><br/>-Получайте бонусы при переходе на следующий уровень!<br/>-Выигрывайте джекпоты!<br/>-Продвигайтесь по игре и открывайте новые уровни, повышая свою максимальную ставку!<br/>-Игра в бесплатные слоты, в какие вам никогда раньше не приходилось играть!<br/><br/>Пользуйтесь удачным моментом, чтобы иметь возможность повысить свою прибыль!'', ''video'': None, ''iap_range'': None, ''interactive_elements'': [], ''installs'': [1000, 5000], ''thumbnails'': [''https://lh3.googleusercontent.com/NU84BJkre42BS3VJ2ZQAyUFV6Cs_3Cbt1q3BnSW2wiqzX-QI3aC97eXuUMOt0BUNfA0x=h310'', ''https://lh3.googleusercontent.com/t8AZoVHQ0S2Zuq6krIpFU1xtLcWE3bp85SQmTsFcR4h5iJrSObnHuhpPvJrPdKRKGw=h310'', ''https://lh3.googleusercontent.com/mZgU0_2ZLOAyq02g3096I5p0b5pqz1FkQNWEMG0ktYrfCm0sYYI0-eOREdlVGpzpEuY=h310''], ''iap'': False, ''price'': ''0'', ''updated'': ''11 февраля 2018 г.'', ''icon'': ''https://lh3.googleusercontent.com/eBG0ac6S6Ev593dKTt3vkEj4pGkQw1TRPFor2gV7lqrgd4zt6vLYvhRAN-dCZWSGyg'', ''description'': ''Ищите лучшие слоты-автоматы ? Вы их уже нашли, устанавливайте приложение и присоединяйтесь к игре в самые популярные БЕСПЛАТНЫЕ игровые слоты\nClub Deluxe\n! Играйте и развлекайтесь единственными в своем роде слотами в стиле люкс, одно удовольствие без реальных затрат!\nБольшие бонусы игровых автоматов! Делать ставки онлайн без настоящего денежного риска так просто, ведь у вас есть целый вагон бесплатных монеток!\n-Получайте бонусы при переходе на следующий уровень!\n-Выигрывайте джекпоты!\n-Продвигайтесь по игре и открывайте новые уровни, повышая свою максимальную ставку!\n-Игра в бесплатные слоты, в какие вам никогда раньше не приходилось играть!\nПользуйтесь удачным моментом, чтобы иметь возможность повысить свою прибыль!'', ''category'': [''GAME_CASINO''], ''developer_id'': None, ''developer_url'': ''https://pastebin.com/GNY0RfxT'', ''recent_changes'': '''', ''content_rating'': ''12+'', ''ratings'': {1: 2, 2: 2, 3: 2, 4: 2, 5: 2}, ''free'': True, ''editors_choice'': False, ''reviews_text'': {0: {''author'': '' '', ''text'': '' Чето сбой какой то и в помощи онлайн не кто не отвечает. Денги просто слили и все. Поставил линий 9 на 45 а получилось 5 на 1 и никак не переставить. Вообщем хотелось бы получить свои 1700р и ну нафиг ихние обещания только деньги вымогают каких то 20 спинов когда должно быть 200. '', ''date'': ''''}, 1: {''author'': '' Сергей Данилов '', ''text'': '' Скачал совсем недавно эти слоты, но уже оценил. Прога сделана красочно, удобный интерфейс, и главное слоты нормальные, можно неплохо выиграть. Вообщем, понравилось, пять баллов! '', ''date'': ''''}, 2: {''author'': '' Andrew Aleksandrovich '', ''text'': '' Иногда хочется просто на досуге покрутить автоматы без денежных затрат. Это приложение дает такую возможность) хороший выбор автоматов, грасочная графа, идет у меня без лагов. '', ''date'': ''''}, 3: {''author'': '' '', ''text'': '' Установил Вулкан Club Deluxe несколько месяцев назад. Приложение - супер! Яркая графика, понятный интерфейс, отсутствие глюков в работе, множество автоматов и, конечно, регулярные выигрыши. '', ''date'': ''''}, 4: {''author'': '' '', ''text'': '' Как перевести на карту из вулкана Скажите пожалуйста '', ''date'': ''''}, 5: {''author'': '' PB Like '', ''text'': '' Как выводить деньги на QIWIили WebMoney '', ''date'': ''''}, 6: {''author'': '' '', ''text'': '' Чето сбой какой то и в помощи онлайн не кто не отвечает. Денги просто слили и все. Поставил линий 9 на 45 а получилось 5 на 1 и никак не переставить. Вообщем хотелось бы получить свои 1700р и ну нафиг ихние обещания только деньги вымогают каких то 20 спинов когда должно быть 200. '', ''date'': ''21 февраля 2018 г.''}, 7: {''author'': '' Сергей Данилов '', ''text'': '' Скачал совсем недавно эти слоты, но уже оценил. Прога сделана красочно, удобный интерфейс, и главное слоты нормальные, можно неплохо выиграть. Вообщем, понравилось, пять баллов! '', ''date'': ''16 февраля 2018 г.''}, 8: {''author'': '' Andrew Aleksandrovich '', ''text'': '' Иногда хочется просто на досуге покрутить автоматы без денежных затрат. Это приложение дает такую возможность) хороший выбор автоматов, грасочная графа, идет у меня без лагов. '', ''date'': ''17 февраля 2018 г.''}, 9: {''author'': '' '', ''text'': '' Установил Вулкан Club Deluxe несколько месяцев назад. Приложение - супер! Яркая графика, понятный интерфейс, отсутствие глюков в работе, множество автоматов и, конечно, регулярные выигрыши. '', ''date'': ''16 февраля 2018 г.''}, 10: {''author'': '' '', ''text'': '' Как перевести на карту из вулкана Скажите пожалуйста '', ''date'': ''21 февраля 2018 г.''}, 11: {''author'': '' PB Like '', ''text'': '' Как выводить деньги на QIWIили WebMoney '', ''date'': ''19 февраля 2018 г.''}, 12: {''author'': '' Геннадий Федоров '', ''text'': '' Класс, здесь собраны все лучшие слоты. Столько бонусов, призовых игр. Именно это я и хотел. Играю, азарт такой, просто не оторвать. Чтоб отвлечься и отдохнуть в свободное времени - самое оно. '', ''date'': ''19 февраля 2018 г.''}, 13: {''author'': '' iskander nurullin '', ''text'': '' Играю с целью отдохнуть от суеты. Есть много неплохих слотов, например, Кекс, где постоянно мне везёт, или же Рулетка. Каких-то крупных выигрышей ещё не случалось, но мелких каждый день. '', ''date'': ''17 февраля 2018 г.''}, 14: {''author'': '' Александр Дудак '', ''text'': '' В эту игру постоянно хочется и хочется играть, как наркотик. Приложение просто создано для азартных людей. Мне очень нравится что игра не на реальные деньги, но от этого азарта становится не меньше, чем игра была бы на настоящие деньги. '', ''date'': ''17 февраля 2018 г.''}, 15: {''author'': '' '', ''text'': '' Установил себе на смартфон приложение Club Deluxe, слоты реально рабочие, дают частенько выигрышь, выпадает много бонусов, уже выиграл 7500. Работать без сбоев, интерфейс удобный. '', ''date'': ''19 февраля 2018 г.''}, 16: {''author'': '' Владимир Шилов '', ''text'': '' Хотел себе на телефон какие-нибудь интресные игровые автоматы установить, нашёл вот это приложение. По-моему неплохо, подборка слотов хорошая, выигрыши частые, ещё и бонусы дают. '', ''date'': ''16 февраля 2018 г.''}}, ''reviews'': 15, ''top_developer'': False, ''screenshots'': [''https://lh3.googleusercontent.com/NU84BJkre42BS3VJ2ZQAyUFV6Cs_3Cbt1q3BnSW2wiqzX-QI3aC97eXuUMOt0BUNfA0x=h900'', ''https://lh3.googleusercontent.com/t8AZoVHQ0S2Zuq6krIpFU1xtLcWE3bp85SQmTsFcR4h5iJrSObnHuhpPvJrPdKRKGw=h900'', ''https://lh3.googleusercontent.com/mZgU0_2ZLOAyq02g3096I5p0b5pqz1FkQNWEMG0ktYrfCm0sYYI0-eOREdlVGpzpEuY=h900''], ''developer_address'': None, ''score'': 4.4666666984558105, ''app_id'': ''com.gbacom.gameclubdeluxe'', ''developer_email'': ''demchik.dii@gmail.com'', ''required_android_version'': ''4.3 или более поздняя'', ''developer'': ''Диана Демчинская'', ''url'': ''https://play.google.com/store/apps/details?id=com.gbacom.gameclubdeluxe'', ''current_version'': ''3.20''}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('1235777439', 'IOS', '2017-11-04 01:06:14.054551', 'Вулкан эмоций - сорви джекпот', 'UNAVAILABLE', 'https://itunes.apple.com/ru/app/id1235777439', 'http://is2.mzstatic.com/image/thumb/Purple127/v4/16/3a/0d/163a0d42-995e-ed28-939a-d92ecbf487c8/pr_source.png/175x175bb-85.png', '2018-01-19 14:06:14.875200','' , '{''im:price'': {''label'': ''Загрузить'', ''attributes'': {''currency'': ''RUB'', ''amount'': ''0.00000''}}, ''title'': {''label'': ''Вулкан эмоций - сорви джекпот - Ha Tran''}, ''im:image'': [{''label'': ''http://is5.mzstatic.com/image/thumb/Purple127/v4/16/3a/0d/163a0d42-995e-ed28-939a-d92ecbf487c8/pr_source.png/53x53bb-85.png'', ''attributes'': {''height'': ''53''}}, {''label'': ''http://is4.mzstatic.com/image/thumb/Purple127/v4/16/3a/0d/163a0d42-995e-ed28-939a-d92ecbf487c8/pr_source.png/75x75bb-85.png'', ''attributes'': {''height'': ''75''}}, {''label'': ''http://is2.mzstatic.com/image/thumb/Purple127/v4/16/3a/0d/163a0d42-995e-ed28-939a-d92ecbf487c8/pr_source.png/100x100bb-85.png'', ''attributes'': {''height'': ''100''}}], ''rights'': {''label'': ''© Tran, Jimmy''}, ''im:contentType'': {''attributes'': {''label'': ''Приложение'', ''term'': ''Application''}}, ''im:name'': {''label'': ''Вулкан эмоций - сорви джекпот''}, ''link'': {''attributes'': {''rel'': ''alternate'', ''type'': ''text/html'', ''href'': ''https://itunes.apple.com/ru/app/%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD-%D1%8D%D0%BC%D0%BE%D1%86%D0%B8%D0%B9-%D1%81%D0%BE%D1%80%D0%B2%D0%B8-%D0%B4%D0%B6%D0%B5%D0%BA%D0%BF%D0%BE%D1%82/id1235777439?mt=8&uo=2''}}, ''category'': {''attributes'': {''scheme'': ''https://itunes.apple.com/ru/genre/ios-%D0%B8%D0%B3%D1%80%D1%8B/id6014?mt=8&uo=2'', ''term'': ''Games'', ''im:id'': ''6014'', ''label'': ''Игры''}}, ''im:releaseDate'': {''label'': ''2017-11-03T00:17:18-07:00'', ''attributes'': {''label'': ''03.11.2017''}}, ''id'': {''label'': ''https://itunes.apple.com/ru/app/%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD-%D1%8D%D0%BC%D0%BE%D1%86%D0%B8%D0%B9-%D1%81%D0%BE%D1%80%D0%B2%D0%B8-%D0%B4%D0%B6%D0%B5%D0%BA%D0%BF%D0%BE%D1%82/id1235777439?mt=8&uo=2'', ''attributes'': {''im:bundleId'': ''tv.advantaged.solit'', ''im:id'': ''1235777439''}}, ''summary'': {''label'': ''Воспользуйтесь отличной возможностью сорвать джекпот.\nИгровые автоматы вулкан клуб - это супер слоты. В наших слотах выиграть легко - поэтому вы получите удовольствие от времяпровождения за игрой\n\nОсобенности:\n- Огромные бонусы для новых игроков\n- Круглосуточная поддержка \n- Приятная графика и звуковое сопровождение\n\nИгровые автоматы вулкан - это всегда честные игровые автоматы и сопутствующая удача!''}, ''im:artist'': {''label'': ''Ha Tran'', ''attributes'': {''href'': ''https://itunes.apple.com/ru/developer/ha-tran/id1230424967?mt=8&uo=2''}}}');
INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('1286539633', 'IOS', '2017-11-26 03:05:21.276802', 'Автоматы вулкан - слоты', 'UNAVAILABLE', 'https://itunes.apple.com/ru/app/id1286539633', 'http://is1.mzstatic.com/image/thumb/Purple128/v4/9c/29/3e/9c293e34-59f6-b015-3f28-3c85c56d73a5/pr_source.png/175x175bb-85.png', '2018-01-19 14:06:15.732491','' , '{''category'': {''attributes'': {''im:id'': ''6014'', ''scheme'': ''https://itunes.apple.com/ru/genre/ios-%D0%B8%D0%B3%D1%80%D1%8B/id6014?mt=8&uo=2'', ''term'': ''Games'', ''label'': ''Игры''}}, ''im:price'': {''label'': ''Загрузить'', ''attributes'': {''amount'': ''0.00000'', ''currency'': ''RUB''}}, ''summary'': {''label'': ''Благодаря мобильному приложению можно забыть о том, что такое регулярные проигрыши. Ведь можно испытывать настоящие эмоции без рисков. Сразу же можно делать несколько ставок, начиная с самой минимальной. Мобильное приложение это – большое количество позитивных эмоций и захватывающие классические игры. Нужно всего лишь скачать приложение на свой телефон, запустить его и начать игру. \n\nОсобенности:\n\n- Бонус для начала игры\n- Мы всегда, круглосуточно ответим на любой вопрос\n- Отличная, красивая графика в сопровождении музыки\n\nИгра будет доступна в любом удобном для вас месте. Простой интерфейс не вызовет трудностей даже у новичка. Получить лучшие навыки игры, научиться делать просчеты, вычислять каждое действие наперед теперь стало гораздо проще с нашим приложением.\n\nЕсли ты любитель азартных игр, твоя госпожа удача всегда будет с тобой.''}, ''im:artist'': {''label'': ''Matthew Clark'', ''attributes'': {''href'': ''https://itunes.apple.com/ru/developer/matthew-clark/id1260606054?mt=8&uo=2''}}, ''link'': {''attributes'': {''href'': ''https://itunes.apple.com/ru/app/%D0%B0%D0%B2%D1%82%D0%BE%D0%BC%D0%B0%D1%82%D1%8B-%D0%B2%D1%83%D0%BB%D0%BA%D0%B0%D0%BD-%D1%81%D0%BB%D0%BE%D1%82%D1%8B/id1286539633?mt=8&uo=2'',