вулканэ-это нечто! Ты ничего не платишь и можешь поставить даже без регистрации.\nПросто отдайся в объятья развлечений и азарта, и наслаждайся крутой игрой.\nБесплатные КРЕДИТЫ для новых игроков\nБонусами тяжело уже впечатлить, но если бы ты видел какие они огромные!\nКаждый день проверяй и собирай плюсы к карме.\nСамое главное, бонусы-это твой оберег: слил-забрал бонус-вернул  и выиграл больше!\nНЕИСЧИСЛЯЕМОЕ количество тематик игровых автоматов\nТы будешь в шоке от изобилия слотов. Выбор колеблется, начиная с делюкс и оригинальных моделей, до ставок на клубнички и мини-игры в сизлинг хот, или же забавные анимации в garage!\nТурниры и космический JACKPOT\nМечтаешь удвоить выигрыш ? Теперь это легко: участвуй в турнире, при этом получай приз в десяти- или двадцатикратном размере! Играй  как герой боевика , не бойся рисковать и у тебя выстрелит.\nЭта игра-настоящий бум для любителей казино!\nМечты сбываются! Просто скачай и начни играть в вулкан на своём смартфоне!'', ''video'': None, ''free'': True, ''reviews'': 4, ''title'': ''Крутые слоты автоматы'', ''ratings'': {1: 1, 2: 1, 3: 1, 4: 1, 5: 1}, ''developer_email'': ''zgonnik.nat@gmail.com''}');
