INSERT INTO application(app_id, platform, creation_date, title, status, url, icon_url, deleted_date, full_data, migrated_data) VALUES ('liji.limajiori', 'ANDROID', '2018-02-24 03:01:29.683309', 'Игровые слоты', 'UNAVAILABLE', 'https://play.google.com/store/apps/details?id=liji.limajiori', 'https://lh3.googleusercontent.com/cfmi63P8l5ZIpf1mohbm2hr8QGI5olGHKrRJKaS_N5UA9-8jXWDozH09u394oFrQzlY', '2018-02-26 16:00:47.746775','' , '{''editors_choice'': False, ''updated'': ''21 февраля 2018 г.'', ''recent_changes'': ''Обновленная версия мобильного приложения'', ''interactive_elements'': [], ''required_android_version'': ''4.0.3 или более поздняя'', ''title'': ''Игровые слоты'', ''iap'': False, ''iap_range'': None, ''description_html'': ''Мы, с вами, почти каждый день слышим о различных казино, которые стали уже некоторой частью нашей повседневной жизни. Тысячи или миллионы их, работают каждый день, по всему миру. Но вот в последние годы, широкую известность обретает такой формат, как онлайн вулкан.<br/><br/>И так, вам стало интересно, так а что же он собой являет? А это популярная имитация самых дорогих и известных казино мира. Только вам не нужно куда-то идти, обменивать деньги на фишки, и делать много чего другого, а просто всего лишь нужно скачать наше приложение, совершенно бесплатно, поставить на свой телефон, планшет или компьютер и наслаждаться приятной игрой в самые различные игровые автоматы. Вы можете заходить в удобное для вас время, в любом месте, будь то вы на обеденном перерыве или в транспорте, мы работаем для вас 24/7! <br/><br/>В нашей команде имеется техническая поддержка, которая поможет вам в случае возникновения вопросов или проблем. Работает ежедневно, без перерывов и выходных.<br/><br/>Ниже представляем вам новые достоинства обновленное версии наших игровых аппаратов:<br/>- Увеличили количество самих игр на 40. Теперь вам точно будет выбрать, во что поиграть<br/>- Облегчили геймплей, что бы сама игра была менее требовательна к параметрам вашего гаджета<br/>- Сделали подсказки на протяжении всей игры, что бы облегчить вам игру<br/>- Так же появилась возможность играть без подключения к интернету. Часто такое бывает, что у вас пропала связь или неожиданно закончились деньги, но это теперь не станет преградой на пути<br/><br/>Теперь напомним вам, за что же многие игроки полюбили наши онлайн слоты:<br/>- Приветственный бонус 200% при регистрации<br/>- 1000 бесплатных вращений каждый день<br/>- Розыгрыши различных подарков на протяжении всей недели<br/>- Приятные сюрпризы при прохождении заданий<br/><br/>Становитесь членом нашего клуба вулкан 24 и вперед за победами! И запомните, победа всегда сопутствует настойчивым людям!'', ''content_rating'': ''12+'', ''developer_address'': None, ''app_id'': ''liji.limajiori'', ''screenshots'': [''https://lh3.googleusercontent.com/13-kyGbxQxyXeyI7N2MKWQqLycOVuTTW0Cp5AzuzC0ifpsWIpMmUnioW4BtiVMKyV9Q=h900'', ''https://lh3.googleusercontent.com/uvrANsM449eEM6hAagEgnVxo0iP68J1qaYo2hGeDgYWu8uVAJ18LaKw7OeWNammFxR0=h900'', ''https://lh3.googleusercontent.com/kAnNW8xk4n2ws7xPFWQlhaoxhr1mMQVJbRIYXhe2jEvuGo7cjiAiBeaZN581jSBb9oA=h900''], ''developer_id'': None, ''installs'': [100, 500], ''icon'': ''https://lh3.googleusercontent.com/cfmi63P8l5ZIpf1mohbm2hr8QGI5olGHKrRJKaS_N5UA9-8jXWDozH09u394oFrQzlY'', ''reviews'': 3, ''reviews_text'': {0: {''date'': '''', ''author'': '' '', ''text'': '' Всё, что Вам нужно, - это скачать приложение и играть. Желаю удачи. ''}, 1: {''date'': ''22 февраля 2018 г.'', ''author'': '' '', ''text'': '' Всё, что Вам нужно, - это скачать приложение и играть. Желаю удачи. ''}}, ''category'': [''GAME_CASINO''], ''thumbnails'': [''https://lh3.googleusercontent.com/13-kyGbxQxyXeyI7N2MKWQqLycOVuTTW0Cp5AzuzC0ifpsWIpMmUnioW4BtiVMKyV9Q=h310'', ''https://lh3.googleusercontent.com/uvrANsM449eEM6hAagEgnVxo0iP68J1qaYo2hGeDgYWu8uVAJ18LaKw7OeWNammFxR0=h310'', ''https://lh3.googleusercontent.com/kAnNW8xk4n2ws7xPFWQlhaoxhr1mMQVJbRIYXhe2jEvuGo7cjiAiBeaZN581jSBb9oA=h310''], ''developer